    t[192] = "SAM (Simple Anonymous Messaging) is a protocol which allows a client application written in any programming language to communicate over I2P, by using a socket-based interface to the I2P router. For more information, see the <a href=https://geti2p.net/en/docs/api/samv3 class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[193] = "SAM (Sad\u0259 Anonim Mesajla\u015fma) h\u0259r-hans\u0131 bir programla\u015fd\u0131rma dili il\u0259 yaz\u0131lm\u0131\u015f bir m\u00fc\u015ft\u0259ri t\u0259tbiqat\u0131n\u0131n I2P \u00fcz\u0259rind\u0259 m\u0259lumat almas\u0131na imkan ver\u0259n bir protokoldur. Bu, I2P y\u00f6nl\u0259ndiricisin\u0259 qulaql\u0131 socket-interface vasit\u0259sil\u0259 etiraza icaz\u0259 ver\u0259n bir protokoldur. \u018ftrafl\u0131 m\u0259lumat \u00fc\u00e7\u00fcn <a href=https://geti2p.net/en/docs/api/samv3 class='sitelink external' target=_blank rel=noreferrer>\u0259lav\u0259 m\u0259lumatlar</a>-a bax\u0131n.";
