    t[549] = "Fayldan yenid\u0259n istifad\u0259 etm\u0259k";
    t[554] = "Choose a name for your website (<i>hostname</i>.i2p), using lower-case. To verify that the hostname is available, check <a href=http://notbob.i2p/ target=_blank>notbob.i2p</a> or <a href=http://reg.i2p target=_blank>reg.i2p</a> before you decide. Enter the new name for your website on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a> where it says <i>Website name</i>, replacing the default <i>mysite.i2p</i> placeholder. If you want your website to be available when I2P starts, enable <i>Auto Start</i> and then click <i>Save</i>.";
    t[555] = "Veb sayt\u0131n\u0131z \u00fc\u00e7\u00fcn bir ad se\u00e7in (<i>hostname</i>.i2p) v\u0259 ki\u00e7ik h\u0259rfl\u0259rd\u0259 istifad\u0259 edin. Hostun ad\u0131n\u0131n m\u00f6vcud olub olmad\u0131\u011f\u0131n\u0131 yoxlamaq \u00fc\u00e7\u00fcn <a href=http://notbob.i2p/ target=_blank>notbob.i2p</a> v\u0259 ya <a href=http://reg.i2p target=_blank>reg.i2p</a> \u00fcnvanlar\u0131na daxil olun. Yeni veb sayt\u0131n\u0131z\u0131n ad\u0131n\u0131 <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a> s\u0259hif\u0259sind\u0259ki <i>Website name</i> b\u00f6lm\u0259sin\u0259 daxil edin. Burada, standart <i>mysite.i2p</i> ad\u0131n\u0131 \u0259v\u0259z ed\u0259c\u0259k \u015f\u0259kild\u0259 yeni ad\u0131 qeyd edin. \u0130st\u0259yirsinizs\u0259, I2P ba\u015flad\u0131ld\u0131qda veb sayt\u0131n\u0131z\u0131n \u0259l\u00e7atmas\u0131n\u0131 ist\u0259yirsinizs\u0259, <i>Auto Start</i> se\u00e7\u0259g\u0259rini aktivl\u0259\u015fdirin v\u0259 sonra <i>Save</i> d\u00fcym\u0259sin\u0259 bas\u0131n.";
