    t[620] = "While I2P will work fine in this configuration, if you really have over 128KBps of bandwidth to share, it will be much more helpful to the network if you open your firewall.";
    t[621] = "I2P bu konfiqurasiyada yax\u015f\u0131 i\u015fl\u0259s\u0259 d\u0259, h\u0259qiq\u0259t\u0259n payla\u015fmaq \u00fc\u00e7\u00fcn 128KBps-d\u0259n \u00e7ox \u00f6t\u00fcrm\u0259 qabiliyy\u0259tiniz varsa, firewallunuzu a\u00e7san\u0131z, \u015f\u0259b\u0259k\u0259 \u00fc\u00e7\u00fcn daha faydal\u0131 olacaq.";
    t[622] = "A command-line application supplied with I2P that is used to request URL resources, similar to <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> or <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget is also used internally by the router, for example to reseed from remote hosts. By default, eepget uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[623] = "\u01302P il\u0259 t\u0259min edil\u0259n v\u0259 URL resurslar\u0131na m\u00fcraci\u0259t etm\u0259k \u00fc\u00e7\u00fcn istifad\u0259 olunan bir komand s\u0259tiri t\u0259tbiqidir, <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> v\u0259 ya <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a> il\u0259 ox\u015fard\u0131rlar. Eepget, m\u0259s\u0259l\u0259n, uzaq qabla\u015f\u0131q (hostlardan yenid\u0259n doldurmaq) \u00fc\u00e7\u00fcn routerin daxili olaraq t\u0259tbiq edilir. Eepget, \u0259sas\u0259n, <code>127.0.0.1:4444</code> \u00fcz\u0259rind\u0259ki HTTP proksin\u0259 \u0259saslanaraq istifad\u0259 olunur.";
