    t[724] = "An eepsite is a website that is hosted anonymously on the I2P network - you can access it by configuring your web browser to use I2P's HTTP proxy (see above) and browsing to the <code>.i2p</code> suffixed website (e.g. <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Also ensure your browser is configured to resolve DNS remotely when using the proxy to avoid DNS leaks.";
    t[725] = "Eepsite I2P \u015f\u0259b\u0259k\u0259sind\u0259 anonim olaraq yerl\u0259\u015fdirilmi\u015f veb saytd\u0131r - ona girm\u0259k \u00fc\u00e7\u00fcn, yuxar\u0131da g\u00f6st\u0259rildiyi kimi s\u00fcr\u00fcc\u00fcn\u00fc I2P'nin HTTP proksisind\u0259n istifad\u0259 etm\u0259yiniz v\u0259 <code>.i2p</code> sonlu veb sayt\u0131na daxil olman\u0131z laz\u0131md\u0131r (m\u0259s\u0259l\u0259n, <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). H\u0259m\u00e7inin DNS s\u0131z\u0131nt\u0131lar\u0131n\u0131 \u00f6nlem\u0259k \u00fc\u00e7\u00fcn, proksi istifad\u0259 edildikd\u0259n s\u00fcr\u00fcc\u00fcn\u00fcn DNS-ni uzaqdan h\u0259ll etm\u0259y\u0259 ayarland\u0131\u011f\u0131ndan \u0259min olun.";
