    t[980] = "Your webserver is running by default at <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a>, but is not accessible by others until you start the <i>I2P Webserver</i> tunnel. After starting the tunnel, your site will be difficult for other people to find. You could just tell people the destination or the Base32 address, but thankfully I2P has an address book to store domain names, and various services where you can <a href=/help/hostnameregistration>register a new .i2p domain</a> for free.";
    t[981] = "Sizin vebserveriniz <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a> \u00fcnvan\u0131nda t\u0259qrib\u0259n i\u015fl\u0259yir, lakin ba\u015fqalar\u0131 t\u0259r\u0259find\u0259n giri\u015f edil\u0259n\u0259 q\u0259d\u0259r \u0259l\u00e7atmazd\u0131r. <i>I2P Webserver</i> tunneli ba\u015flad\u0131ld\u0131qdan sonra ba\u015fqalar\u0131n\u0131n sizin sayt\u0131n\u0131z\u0131 tapmalar\u0131 \u00e7\u0259tindir. Sad\u0259c\u0259 insanlara Sizin ged\u0259c\u0259yiniz \u00f6l\u00e7\u0259yi v\u0259 ya Base32 \u00fcnvan\u0131n\u0131 dey\u0259 bil\u0259rsiniz, lakin, \u015f\u00fck\u00fcr ki, I2P domain adlar\u0131n\u0131 saxlamaq \u00fc\u00e7\u00fcn v\u0259 pulsuz \u015f\u0259kild\u0259 yeni .i2p domaini <a href=/help/hostnameregistration>qeyd etm\u0259k \u00fc\u00e7\u00fcn m\u00fcxt\u0259lif xidm\u0259tl\u0259r</a> m\u00f6vcuddur.";
