    t[1175] = "Bir xidm\u0259t\u0259 qo\u015fulmaq ist\u0259diyinizd\u0259n \u0259ks\u0259rlikl\u0259, BitTorrent (a\u015fa\u011f\u0131dak\u0131 b\u00f6lm\u0259y\u0259 bax\u0131n) hari\u00e7, bunu etm\u0259k m\u00fcmk\u00fcn deyil, xidm\u0259t \u00fc\u00e7\u00fcn bir \u00e7\u0131x\u0131\u015f n\u00f6qt\u0259si qurmaq t\u0259l\u0259b olunur. Haz\u0131rda yaln\u0131z HTTP, HTTPS v\u0259 e-po\u00e7t olmaqla \u00fc\u00e7 tip \u00e7\u0131x\u0131\u015f n\u00f6qt\u0259si \u0259m\u0259kda\u015fl\u0131q edir. \u018flav\u0259 olaraq, indi ictimai siyah\u0131da \u00e7\u0131xar\u0131\u015f n\u00f6qt\u0259si olaraq listed\u0259 olan SOCKS yoxdur. Bu xidm\u0259t\u0259 ehtiyac\u0131n\u0131z varsa, <a href=https://torproject.org/ target=_blank rel=noreferrer class='sitelink external'>Tor</a>-u yoxlay\u0131n.";
