    t[1574] = "The core I2P software, which routes encrypted packets on the I2P network. All routers by default participate in the network except routers running in countries considered hostile (see <i>Strict Countries</i>), which both helps the network and provides cover traffic for any clients or servers connecting to the I2P network through the router.";
    t[1575] = "I2P \u015f\u0259b\u0259k\u0259sind\u0259 \u015fifr\u0259l\u0259nmi\u015f paketl\u0259ri y\u00f6nl\u0259ndirm\u0259k \u00fc\u00e7\u00fcn olan esas I2P proqram t\u0259minat\u0131d\u0131r. \u0130stisna imi\u015fkats\u0131z olaraq, routerl\u0259n bu \u015f\u0259b\u0259k\u0259y\u0259 t\u00f6hf\u0259 ver\u0259r\u0259k \u015f\u0259b\u0259k\u0259y\u0259 yard\u0131m\u00e7\u0131 olur v\u0259 cliet v\u0259 ya server I2P \u015f\u0259b\u0259k\u0259sin\u0259 router vasit\u0259sil\u0259 qo\u015fulan hans\u0131sa istifad\u0259\u00e7i \u00fc\u00e7\u00fcn qal\u0131n\u0131 ke\u00e7id yarad\u0131r. (Bkz \u0130stiqlal kimi hesablana bil\u0259n \u00f6lk\u0259l\u0259r).";
