    t[2189] = "A\u015fa\u011f\u0131dak\u0131 e\u015fik tan\u0131m\u0131 <i class=example>180/60</i>, eyni uzaq istiqam\u0259t\u0259 olan m\u0259nb\u0259nin 60 saniy\u0259lik bir m\u00fcdd\u0259t \u0259rzind\u0259 179 \u0259laq\u0259 c\u0259hdin\u0259 icaz\u0259 verdiyi g\u00f6st\u0259rir. \u018fg\u0259r eyni m\u00fcdd\u0259td\u0259 daha bir c\u0259hdl\u0259r olarsa, e\u015fik q\u0131r\u0131lacaq v\u0259 ba\u011flant\u0131ya \u0259lav\u0259 c\u0259hdl\u0259r m\u00fcdd\u0259tin sonuna q\u0259d\u0259r q\u0259bul edilm\u0259y\u0259c\u0259kdir:";
    t[2190] = "config home";
