    t[2206] = "Version";
    t[2207] = "Versiya";
    t[2210] = "I2P selects a random port between 9000 and 31000 to communicate with other routers when the program is run for the first time, or when your external IP address changes when running in <a href=/confignet#ipchange>Laptop Mode</a>. The <a href=/confignet#udpconfig>selected port</a> is shown on the <a href=/confignet>Network Configuration page</a>.";
    t[2211] = "I2P, program birinci d\u0259f\u0259 i\u015fl\u0259dikd\u0259 v\u0259 ya <a href=/confignet#ipchange>Laptop rejimind\u0259</a> i\u015fl\u0259rk\u0259n xarici IP \u00fcnvan\u0131n\u0131z d\u0259yi\u015fdikd\u0259 dig\u0259r y\u00f6nl\u0259ndiricil\u0259rl\u0259 kommunikasiya \u00fc\u00e7\u00fcn 9000 v\u0259 31000 aras\u0131nda r\u0259q\u0259msiz bir liman se\u00e7ir. Se\u00e7ilmi\u015f <a href=/confignet#udpconfig>liman</a> <a href=/confignet>V\u0259ziyy\u0259tl\u0259r konfiqurasiya s\u0259hif\u0259si</a>nd\u0259 g\u00f6st\u0259rilir.";
