    t[2237] = "gec\u0259 yar\u0131s\u0131";
    t[2246] = "A gentle introduction to I2P";
    t[2247] = "I2P-y\u0259 inc\u0259 giri\u015f";
    t[2250] = "How long jobs are waiting before execution. The job queue is listed on the <a href='/jobs'>Jobs page</a>. Unfortunately, there are several other job queues in the router that may be congested, and their status is not available in the router console. The job lag should generally be zero. If it is consistently higher than 500ms, your computer is very slow, your network is experiencing connectivity issues, or the router has serious problems. <a href='/configstats#jobQueue.jobLag'>[Enable graphing]</a>.";
    t[2251] = "\u0130\u015flerin i\u015fletilmeden \u00f6nce ne kadar s\u00fcre bekledi\u011fi. \u0130\u015f kuyru\u011fu <a href='/jobs'>\u0130\u015fler sayfas\u0131nda</a> listelenir. Ne yaz\u0131k ki, rauterde s\u0131k\u0131\u015fan ba\u015fka i\u015f kuyruklar\u0131 bulunmaktad\u0131r ve durumlar\u0131 rauter konsolunda mevcut de\u011fildir. \u0130\u015f gecikmesi genellikle s\u0131f\u0131r olmal\u0131d\u0131r. E\u011fer s\u00fcrekli olarak 500ms'den daha y\u00fcksekse, bilgisayar\u0131n\u0131z \u00e7ok yava\u015f, a\u011f\u0131n\u0131z ba\u011flant\u0131 sorunlar\u0131 ya\u015f\u0131yor ya da rauterde ciddi sorunlar var demektir. <a href='/configstats#jobQueue.jobLag'>[Grafik \u00e7izimini etkinle\u015ftir]</a>.";
    t[2252] = "Configure I2P Updates";
    t[2253] = "I2P Yenil\u0259m\u0259l\u0259rini konfiqurasiya edin";
    t[2254] = "Before you tell the world about your new website, you should add some content. Go to the server's root directory <a href=#rootdir>listed above</a> and replace the <i>index.html</i> redirect page with your own content. If you need a template for a basic site, feel free to adapt <a href=http://127.0.0.1:7658/help/pagetemplate.html>this page</a>. If you're returned to this page after editing the content, try clearing your browser's web cache.";
    t[2255] = "Yeni veb sayt\u0131n\u0131z haqq\u0131nda d\u00fcnyaya deyism\u0259d\u0259n \u0259vv\u0259l bir ne\u00e7\u0259 m\u0259zmun \u0259lav\u0259 etm\u0259lisiniz. Sunucunun k\u00f6k qovlu\u011funa <a href=#rootdir>\u00fcstd\u0259 g\u00f6st\u0259ril\u0259n</a> v\u0259 s\u0259n\u0259d v\u0259 ya CV-unuzla <i>index.html</i> y\u00f6nl\u0259ndirm\u0259 s\u0259hif\u0259ni \u0259v\u0259z edin. \u018fg\u0259r sad\u0259 bir sayta \u00fc\u00e7\u00fcn \u015fablon t\u0259l\u0259b olunursa, rahat\u00e7a t\u0259tbiq ed\u0259 bil\u0259c\u0259yiniz <a href=http://127.0.0.1:7658/help/pagetemplate.html>bu s\u0259hif\u0259ni</a> istifad\u0259 edin. \u0130\u00e7eri\u011fi d\u00fcz\u0259ldikd\u0259n sonra bu s\u0259hif\u0259y\u0259 qay\u0131d\u0131rsa, brauzerinizin veb \u00f6nbelleyini t\u0259mizl\u0259m\u0259yi yoxlay\u0131n.";
