    t[2311] = "G\u00f6nd\u0259r";
    t[2312] = "If your router has 10 or more active peers, everything is fine. The router should maintain connections to a few peers at all times. The best way to stay \"better-connected\" to the network is to <a href=/config>share more bandwidth</a>.";
    t[2313] = "\u018fg\u0259r y\u00f6nl\u0259ndiricinizd\u0259 10 v\u0259 ya daha \u00e7ox f\u0259al izl\u0259k yolda\u015f\u0131 varsa, h\u0259r \u015fey yax\u015f\u0131 dem\u0259kdir. Y\u00f6nl\u0259ndirici h\u0259r zaman bir ne\u00e7\u0259 yolda\u015fla \u0259laq\u0259l\u0259r saxlamal\u0131d\u0131r. \u015e\u0259b\u0259k\u0259 il\u0259 daha yax\u015f\u0131 ba\u011flant\u0131 qurman\u0131n \u0259n yax\u015f\u0131 yolu <a href=/config>daha \u00e7ox b\u0259nd geni\u015fliyi payla\u015fmaqd\u0131r</a>.";
