    t[2470] = "Manual Peer Controls";
    t[2471] = "\u018fl il\u0259 h\u0259mya\u015f\u0131d konfiqurasiya";
    t[2482] = "This indicates the amount of RAM I2P is using, and the total amount available, allocated by Java. If the usage is consistently high relative to the available RAM, this may indicate that you need to increase the ram allocated to the JVM. You can allocate more RAM by editing your <code>wrapper.config</code> file which is normally located in the I2P application directory. You will need to edit the <code>wrapper.java.maxmemory</code> parameter, which by default is set to 256(MB) for I2P, or 384 for I2P+. Note: if the memory bar is enabled, the memory entry in the router info section will be suppressed.";
    t[2483] = "Bu, I2P'nin kulland\u0131\u011f\u0131 RAM miktar\u0131n\u0131 ve Java taraf\u0131ndan tahsis edilen toplam miktar\u0131 g\u00f6sterir. Kullan\u0131m, mevcut RAM'e g\u00f6re s\u00fcrekli olarak y\u00fcksekse, bunun JVM'ye tahsis edilen RAM'i art\u0131rman\u0131z gerekti\u011fini g\u00f6sterebilir. I2P uygulama dizininde normalde bulunan <code>wrapper.config</code> dosyas\u0131n\u0131 d\u00fczenleyerek daha fazla RAM ay\u0131rabilirsiniz. Varsay\u0131lan olarak I2P i\u00e7in 256 (MB) veya I2P+ i\u00e7in 384 olarak ayarlanm\u0131\u015f olan <code>wrapper.java.maxmemory</code> parametresini d\u00fczenlemeniz gerekecektir. Not: Bellek \u00e7ubu\u011fu etkinse, router info b\u00f6l\u00fcm\u00fcndeki bellek giri\u015fi bast\u0131r\u0131lacakt\u0131r.";
