    t[2537] = "<i>\u0130nternet\u0259 Proksi Giri\u015fini Konfiqurasiya edin</i> alt\u0131nda <i>\u018fl il\u0259 proksi konfiqurasiyas\u0131</i> se\u00e7imini se\u00e7in.";
    t[2538] = "To serve your own static content, you only need to edit or replace the files in the webserver's root directory, and the site will be available on the I2P network after you've followed the instructions below. Additionally, cgi and python scripts can be run from the <code>cgi-bin</code> directory immediately above <code>docroot</code> if you have <a href=https://www.perl.org/about.html target=_blank rel=noreferrer class='sitelink external'>perl</a> and <a href=https://www.python.org/ target=_blank rel=noreferrer class='sitelink external'>python</a> installed.";
    t[2539] = "\u00d6z statik m\u0259zmununuzu paylamaq \u00fc\u00e7\u00fcn ancaq veb serverin \u0259sas qovlu\u011funda olan fayllar\u0131 d\u00fcz\u0259ltm\u0259niz v\u0259 ya \u0259v\u0259z etm\u0259niz kifay\u0259tdir. \u0130stifad\u0259\u00e7i a\u015fa\u011f\u0131da g\u00f6st\u0259ril\u0259n t\u0259limatlara \u0259m\u0259l etdikd\u0259n sonra veb sayt \u01302P \u015f\u0259b\u0259k\u0259sind\u0259 m\u00f6vcud olacaqd\u0131r. \u018flav\u0259 olaraq,  <code>cgi-bin</code> papkas\u0131n\u0131n <code>docroot</code> fayl\u0131n\u0131n hemen yuxar\u0131s\u0131nda yer al\u0131rsa, <a href=https://www.perl.org/about.html target=_blank rel=noreferrer class='sitelink external'>perl</a> v\u0259 <a href=https://www.python.org/ target=_blank rel=noreferrer class='sitelink external'>python</a> qura\u015fd\u0131r\u0131lm\u0131\u015fsa, cgi v\u0259 python skriptl\u0259ri burada i\u015fl\u0259dil\u0259 bil\u0259r.";
