    t[2604] = "I2P requires at least 12KBps to enable sharing. ";
    t[2605] = "I2P payla\u015f\u0131m\u0131 aktivl\u0259\u015fdirm\u0259k \u00fc\u00e7\u00fcn \u0259n az\u0131 12KBps t\u0259l\u0259b edir. ";
    t[2608] = "The current external IP address reported by UPnP is {0}";
