    t[2616] = "If you know and trust somebody that runs I2P, ask them to send you a reseed file generated using this page in their router console. Then, select the <i>Reseed from file</i> option on the {0} using the file you received.";
    t[2617] = "I2P-i i\u015fl\u0259d\u0259n kimis\u0259 tan\u0131y\u0131rsan v\u0259 etibar edirsinizs\u0259, bu s\u0259hif\u0259ni router konsolundak\u0131 bu s\u0259hif\u0259d\u0259n istifad\u0259 ed\u0259r\u0259k yarad\u0131lan bir kiriy\u0259 s\u0259n\u0259d g\u00f6nd\u0259rm\u0259l\u0259rini xahi\u015f edin. Sonra, ald\u0131\u011f\u0131n\u0131z fayldan istifad\u0259 ed\u0259r\u0259k {0} -d\u0259 <i>se\u00e7imd\u0259n se\u00e7imd\u0259n</i> se\u00e7imini se\u00e7in.";
