    t[2680] = "Review possible sybils in network database";
    t[2681] = "\u015e\u0259b\u0259k\u0259 veril\u0259nl\u0259r bazas\u0131nda m\u00fcmk\u00fcn sibill\u0259ri n\u0259z\u0259rd\u0259n ke\u00e7irin";
    t[2682] = "WAN Ethernet Link Configuration";
    t[2683] = "WAN Ethernet Ba\u011flant\u0131 Konfiqurasiyas\u0131";
    t[2696] = "This setting (in seconds) allows you to override the delay between runs of the Peer Exploration Job which attempts to locate new peers to add to the NetDb. The job will run every 80 seconds by default, or if the router is experiencing job or message lag, every 3 minutes. If the size of the NetDb reaches 4000 peers, the pause will increase to 15 minutes. You may wish to increase the delay if your NetDb is well-populated (over 2000 peers), or if you wish to reduce overall bandwidth usage. Note: For Floodfill routers, this job does not run.";
    t[2697] = "Bu ayarlama (saniy\u0259l\u0259rl\u0259) yeni h\u0259r\u0259k\u0259t s\u0259brini (h\u0259d\u0259fl\u0259m\u0259 \u00fczr\u0259 qon\u015fular\u0131 tapmaq \u00fc\u00e7\u00fcn) d\u0259yi\u015fm\u0259y\u0259 imkan verir. Bu i\u015f \u0259d\u0259di by default 80 saniy\u0259d\u0259 bir, v\u0259 ya router i\u015f v\u0259 ya i\u015fdarl\u0131q gecikm\u0259si ya\u015fan\u0131rsa, 3 d\u0259qiq\u0259 interval il\u0259 i\u015fl\u0259yir. \u018fg\u0259r NetDb \u00f6l\u00e7\u00fcs\u00fc 4000 qon\u015fudan \u00e7oxa \u00e7atd\u0131qda, interval 15 d\u0259qiq\u0259y\u0259 \u00e7at\u0131r. Xahi\u015f edirik, NetDb'nin \u00e7ox qon\u015fulu olmas\u0131 (2000 qon\u015fudan \u00e7ox) v\u0259 ya \u00fcmumi bant geni\u015fliyi istifad\u0259sini azaltmaq ist\u0259ndiyi t\u0259qdird\u0259 gecikm\u0259ni art\u0131rmaq ist\u0259y\u0259 bil\u0259rsiniz. Qeyd: Bu i\u015f Floodfill routerlar\u0131 \u00fc\u00e7\u00fcn i\u015fl\u0259mir.";
    t[2698] = "Current";
    t[2699] = "Cari";
    t[2720] = "A website hosted on the I2P network. By default, a <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty webserver</a> is configured and running on <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2721] = "I2P \u015f\u0259b\u0259k\u0259sind\u0259 yerl\u0259\u015f\u0259n bir veb sayt. \u018fsas\u0259n, <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty veb serveri</a> haz\u0131rlan\u0131r v\u0259 <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a> \u00fcz\u0259rind\u0259 i\u015fl\u0259yir.";
    t[2722] = "Can be disabled or changed in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Can also be configured to bind to a specific interface or all interfaces.";
    t[2723] = "S\u00f6nd\u00fcr\u00fcl\u0259 bil\u0259r v\u0259 ya <a href=/i2ptunnelmgr>Tunnel Menecer</a>d\u0259 d\u0259yi\u015fdiril\u0259 bil\u0259r. Ayr\u0131ca m\u00fc\u0259yy\u0259n bir interfeys\u0259 -v\u0259 yaxud b\u00fct\u00fcn interfeysl\u0259r\u0259- ba\u011flamaq \u00fc\u00e7\u00fcn konfiqurasiya edil\u0259 bil\u0259r.";
    t[2728] = "I2P+ Service now enabled on system start";
    t[2729] = "I2P  Xidm\u0259ti indi sistemin ba\u015flan\u011f\u0131c\u0131nda aktivdir";
    t[2748] = "Computer related news aggregation";
    t[2749] = "Komp\u00fcterl\u0259 ba\u011fl\u0131 x\u0259b\u0259rl\u0259rin toplanmas\u0131";
    t[2752] = "Same IP as us";
    t[2753] = "Biziml\u0259 eyni IP";
    t[2754] = "You may create a new router family here. Once you have created the family, you may export the family key file and share with other routers in your nominated family.";
    t[2755] = "Burada yeni bir y\u00f6nlendirici ail\u0259 yarada bil\u0259rsiniz. Ail\u0259ni yaratd\u0131qdan sonra ail\u0259nin a\u00e7ar\u0131 fayl\u0131 ixrac ed\u0259 v\u0259 namiz\u0259dliyinizd\u0259ki dig\u0259r mar\u015frutla\u015fd\u0131r\u0131c\u0131larla b\u00f6l\u00fc\u015f\u0259 bil\u0259rsiniz.";
    t[2756] = "Tunnels peer has agreed to participate in";
    t[2757] = "Tunel h\u0259mkar\u0131 i\u015ftirak etm\u0259yi q\u0259bul etdi";
    t[2758] = "Advanced Lookup";
    t[2759] = "Qabaqc\u0131l Axtar\u0131\u015f";
    t[2766] = "In order to access websites hosted on I2P, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P HTTP proxy, by default running on <code>127.0.0.1 port 4444</code>. Most browsers offer an option to configure your proxy; in this mini-tutorial we'll focus on Firefox.";
    t[2767] = "I2P-d\u0259 yerl\u0259\u015fdirilmi\u015f veb saytlara daxil olmaq v\u0259 KlearNet-d\u0259 veb saytlara qo\u015fulmaq \u00fc\u00e7\u00fcn standart Outproxy-d\u0259n istifad\u0259 etm\u0259k \u00fc\u00e7\u00fcn, Clearnet-d\u0259 I2P HTTP proxy istifad\u0259 etm\u0259k \u00fc\u00e7\u00fcn brauzerinizi konfiqurasiya etm\u0259lisiniz <code>127.0.0.1 port 4444</code>. \u018fks\u0259r brauzerl\u0259r v\u0259kilinizi konfiqurasiya etm\u0259k \u00fc\u00e7\u00fcn bir se\u00e7im t\u0259klif edir; Bu mini d\u0259rsd\u0259 Firefox-a diqq\u0259t yetir\u0259c\u0259yik.";
    t[2776] = "Close to us";
    t[2777] = "Biz\u0259 yax\u0131n";
    t[2790] = "I2P+ Router Sitemap";
    t[2791] = "I2P Router Sayt X\u0259rit\u0259si";
    t[2794] = "Downloaded plugin version {0} is not newer than installed plugin";
    t[2795] = "Endiril\u0259n plagin versiyas\u0131 {0} qura\u015fd\u0131r\u0131lm\u0131\u015f plugind\u0259n daha yeni deyil";
    t[2796] = "Streaming radio service";
    t[2797] = "Ax\u0131n radio xidm\u0259ti";
    t[2798] = "I2P+ functions best when you can accurately reflect the speed of your network connection in the <a href=/config>bandwidth configuration section</a>. By default I2P+ is configured with some fairly conservative values that will not suit many use cases, so please take time to review these settings and correct where necessary. The more bandwidth you allocate, <i>specifically</i> upstream bandwidth, the more you will benefit from the network.";
    t[2799] = "Do\u011fru \u015f\u0259b\u0259k\u0259 ba\u011flant\u0131s\u0131n\u0131n s\u00fcr\u0259tini <a href=/config>band geni\u015fliyi konfiqurasiya b\u00f6lm\u0259sind\u0259</a> d\u00fczg\u00fcn \u015f\u0259kild\u0259 t\u0259qdim etdiyiniz zaman I2P+ \u0259n yax\u015f\u0131 i\u015fl\u0259y\u0259r. I2P+ t\u0259xmin\u0259n istifad\u0259\u00e7i \u00e7e\u015fidl\u0259ri il\u0259 uy\u011fun g\u0259lm\u0259y\u0259n m\u00fcs\u0259lman q\u0259rarlar\u0131 il\u0259 t\u0259nziml\u0259nir, bu s\u0259b\u0259bd\u0259n bu t\u0259nziml\u0259m\u0259l\u0259ri \u00f6hd\u0259sind\u0259n g\u0259l\u0259n v\u0259 d\u00fcz\u0259ltm\u0259k \u00fc\u00e7\u00fcn zaman ay\u0131r\u0131n. Band geni\u015fliyi ay\u0131r\u0131m\u0131 n\u0259 q\u0259d\u0259r \u00e7ox olarsa, x\u00fcsus\u0259n yuxar\u0131 ax\u0131n geni\u015fliyi, \u015f\u0259b\u0259k\u0259d\u0259n \u00e7ox fayda g\u00f6r\u0259c\u0259ksiniz.";
    t[2810] = "Transit by Peer";
    t[2811] = "Peer t\u0259r\u0259find\u0259n tranzit";
    t[2812] = "Hidden Mode";
    t[2813] = "Gizl\u0259nmi\u015f Rejim";
    t[2814] = "Plugin requires Jetty version {0} or lower";
    t[2815] = "Qo\u015fma Jetty versiyas\u0131n\u0131 {0} v\u0259 ya daha a\u015fa\u011f\u0131 t\u0259l\u0259b edir";
    t[2822] = "The proxy may be remotely hosted or a service running on your computer (localhost/127.0.0.1).";
    t[2823] = "Proksi uzaqdan qura\u015fd\u0131r\u0131la bil\u0259r v\u0259 ya kompyuterinizd\u0259 (localhost/127.0.0.1) i\u015fl\u0259y\u0259n bir xidm\u0259t olaraq ola bil\u0259r.";
    t[2824] = "Events in peak period";
    t[2825] = "Pik d\u00f6vrd\u0259ki hadis\u0259l\u0259r";
    t[2838] = "Router Console &amp; WebApps Display Language";
    t[2839] = "Router Konsolu";
    t[2844] = "What to do in the event I2P+ isn't working";
    t[2845] = "I2P+ i\u015flemirdis\u0259 n\u0259 etm\u0259k laz\u0131md\u0131r";
    t[2856] = "ANONYMITY WARNING - Settings include 1-hop tunnels.";
    t[2857] = "ANON\u0130ML\u0130K X\u018fB\u018fRDARLI\u011eI - Parametrl\u0259r\u0259 1-hop tunell\u0259ri daxildir.";
    t[2858] = "I2P IRC Network";
    t[2859] = "I2P IRC \u015e\u0259b\u0259k\u0259si";
    t[2864] = "pixels wide";
    t[2865] = "piksel geni\u015fliyi";
    t[2882] = "The I2P Network Protocol (I2NP) manages the routing and mixing of messages between routers, in addition to the transport selection (where more than one is supported) when communicating with a peer. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[2883] = "I2P Network Protocol (I2NP), ruterl\u0259r aras\u0131nda mesajlar\u0131n y\u00f6nl\u0259ndirilm\u0259sini v\u0259 qar\u0131\u015fd\u0131r\u0131lmas\u0131n\u0131 idar\u0259 edir, h\u0259m\u00e7inin h\u0259lli (daha \u00e7ox d\u0259st\u0259kl\u0259n\u0259nd\u0259 bird\u0259n \u00e7ox olaraq) il\u0259 e\u015fd\u0259yli \u015f\u0259kild\u0259 \u0259laq\u0259l\u0259ndikd\u0259 (b\u0259rab\u0259r istifad\u0259d\u0259) transport se\u00e7kisi. Daha \u0259trafl\u0131 m\u0259lumat \u00fc\u00e7\u00fcn <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>onlayn s\u0259n\u0259dl\u0259ndirm\u0259y\u0259</a> bax\u0131n.";
    t[2884] = "Expired {0} ago";
    t[2885] = "M\u00fcdd\u0259ti {0} \u0259vv\u0259l ke\u00e7ib";
    t[2892] = "Your router's status on accepting or rejecting requests from other routers to build a participating tunnel through your router. Your router may accept all requests, accept or reject a percentage of requests, or reject all requests for a number of reasons, to control the bandwidth and CPU demands and maintain capacity for local clients. <b>Note";
    t[2893] = "Raat\u0259n q\u0259bul ed\u0259n v\u0259 ya r\u0259dd ed\u0259n routerd\u0259n dig\u0259r routerl\u0259rin sizin routeriniz vasit\u0259sil\u0259 i\u015ftirak ed\u0259n bir b\u00f6y\u00fck tunnel qurmaq \u00fc\u00e7\u00fcn t\u0259l\u0259b\u0259 q\u0259bul etm\u0259si v\u0259 ya r\u0259dd etm\u0259sinin v\u0259ziyy\u0259tiniz. Routeriniz b\u00fct\u00fcn t\u0259l\u0259bl\u0259ri q\u0259bul ed\u0259 bil\u0259r, t\u0259l\u0259bl\u0259rin bir ne\u00e7\u0259 faizini q\u0259bul ed\u0259r v\u0259 ya r\u0259dd ed\u0259 bil\u0259r, v\u0259 ya yerli m\u00fc\u015ft\u0259ril\u0259rin kapasitetini saxlamaq, kabel v\u0259 CPU t\u0259l\u0259bl\u0259rini idar\u0259 etm\u0259k m\u0259qs\u0259dil\u0259 bir ne\u00e7\u0259 s\u0259b\u0259bd\u0259n dolay\u0131 b\u00fct\u00fcn t\u0259l\u0259bl\u0259ri r\u0259dd ed\u0259 bil\u0259r. <b>Qeyd";
    t[2902] = "Please contact a known trustworthy friend who has a running I2P router, and ask them for help with reseeding your I2P router. Request that they send you a reseed file exported from their running I2P router. It is vital that the file is exchanged over a secure channel, e.g. encrypted to avoid external tampering (PGP Sign, Encrypt and Verified with a trusted public key). The file itself is unsigned, so please accept files only from known trusted friends. Never import a reseed file if you cannot verify its source.";
    t[2903] = "Z\u0259hm\u0259t olmasa i2P y\u00f6nlendiricisi olan tan\u0131nm\u0131\u015f etibarl\u0131 bir dostla \u0259laq\u0259 saxlay\u0131n v\u0259 i2P y\u00f6nlendiricisini yenid\u0259n qurma\u011f\u0131n\u0131za k\u00f6m\u0259k ist\u0259m\u0259yin. Siz\u0259 \u01302P y\u00f6nlendiricisind\u0259n istifad\u0259 etdiyi bir rezed fayl g\u00f6nd\u0259rdikl\u0259rini t\u0259l\u0259b edin. Fayl\u0131n etibarl\u0131 bir kanal \u00fcz\u0259rind\u0259 m\u00fcbadil\u0259 olunmas\u0131 vacibdir, m\u0259s\u0259l\u0259n, E.G. Xarici poz\u011funun qar\u015f\u0131s\u0131n\u0131 almaq \u00fc\u00e7\u00fcn \u015fifr\u0259l\u0259nmi\u015f (PGP i\u015far\u0259si, \u015fifr\u0259l\u0259nmi\u015f v\u0259 etibarl\u0131 bir ictimai a\u00e7ar il\u0259 t\u0259sdiql\u0259nmi\u015fdir). Fayl\u0131n \u00f6z\u00fc imzalanmam\u0131\u015fd\u0131r, buna g\u00f6r\u0259 fayllar\u0131 yaln\u0131z m\u0259lum etibarl\u0131 dostlardan q\u0259bul edin. He\u00e7 vaxt m\u0259nb\u0259yini yoxlaya bilmirsinizs\u0259, bir resed fayl\u0131 idxal etm\u0259yin.";
    t[2916] = "Last Good Send";
