    t[2918] = "Delete this value to disable";
    t[2919] = "Deaktiv etm\u0259k \u00fc\u00e7\u00fcn bu d\u0259y\u0259ri silin";
    t[2920] = "You can use a recorder in one tunnel that writes to a file that another tunnel, or multiple tunnels, can use for throttling. These files can also be edited by hand.";
    t[2921] = "Siz s\u00fcr\u0259t m\u0259hdudla\u015fd\u0131rmaq \u00fc\u00e7\u00fcn dig\u0259r bir b\u00f6lm\u0259 v\u0259 ya bird\u0259n \u00e7ox b\u0259r\u0259k\u0259t kollektoru yazmaq \u00fc\u00e7\u00fcn bir fayl\u0131 qeyd ed\u0259n bir b\u0259r\u0259k\u0259t istifad\u0259 ed\u0259 bil\u0259rsiniz. Bu fayllar \u0259l il\u0259 d\u00fcz\u0259li\u015f edil\u0259 bil\u0259r.";
