    t[2956] = "The Java web applications listed below are started by the webConsole client and run in the same JVM as the router. They are usually web applications accessible through the router console. They may be complete applications (e.g. i2psnark), front-ends to another client or application which must be separately enabled (e.g. susidns, i2ptunnel), or have no web interface at all (e.g. addressbook).";
    t[2957] = "A\u015fa\u011f\u0131da sadalanan Java veb t\u0259tbiqetm\u0259l\u0259ri veb-kamonlu m\u00fc\u015ft\u0259ri t\u0259r\u0259find\u0259n ba\u015flan\u0131r v\u0259 router kimi eyni JVM-d\u0259 i\u015fl\u0259k. Onlar \u00fcmumiyy\u0259tl\u0259 y\u00f6nl\u0259ndirm\u0259 konsolu vasit\u0259sil\u0259 \u0259ld\u0259 edil\u0259 bil\u0259n veb t\u0259tbiqetm\u0259l\u0259rdir. Onlar tam t\u0259tbiqetm\u0259l\u0259r (m\u0259s\u0259l\u0259n, ayr\u0131ca aktiv olmal\u0131d\u0131r (m\u0259s\u0259l\u0259n, e.g. susidns, i2ptunnel) v\u0259 ya he\u00e7 bir veb interfeysi yoxdur (m\u0259s\u0259l\u0259n, \u00fcnvan kitab\u00e7as\u0131) olmal\u0131d\u0131r.";
    t[2960] = "WARNING - Inbound 0-hop tunnels not recommended for hidden routers.";
    t[2961] = "X\u018fB\u018fRDARLIQ - Daxil olan 0-hop tunell\u0259ri gizli mar\u015frutla\u015fd\u0131r\u0131c\u0131lar \u00fc\u00e7\u00fcn t\u00f6vsiy\u0259 edilmir.";
    t[2972] = "HTTP Proxy";
    t[2973] = "HTTP Proksi";
    t[2978] = "This is the total number of peers that are known by your router. They are listed on the <a href='/netdb'>Network Database page</a>. This may range from under 100 to 1000 or more. This number is not the total size of the network; it may vary widely depending on your total bandwidth, shared bandwidth, and locally-generated traffic. I2P does not require a router to know every other router in the network.";
    t[2979] = "Bu, mar\u015frutla\u015fd\u0131r\u0131c\u0131 t\u0259r\u0259find\u0259n tan\u0131nan h\u0259mya\u015f\u0131dlar\u0131n \u00fcmumi say\u0131. Onlar <a href='/netdb't \u015f\u0259b\u0259k\u0259 veril\u0259nl\u0259r bazas\u0131 s\u0259hif\u0259sind\u0259 siyah\u0131ya al\u0131n\u0131r</a>. Bu 100 il\u0259 1000 v\u0259 ya daha \u00e7ox aras\u0131nda d\u0259yi\u015f\u0259 bil\u0259r. Bu n\u00f6mr\u0259 \u015f\u0259b\u0259k\u0259nin \u00fcmumi \u00f6l\u00e7\u00fcs\u00fc deyil; Bu, \u00fcmumi bant geni\u015fliyinizd\u0259n, payla\u015f\u0131lan bant geni\u015fliyinizd\u0259n v\u0259 yerli yarad\u0131lan trafikd\u0259n as\u0131l\u0131 ola bil\u0259r. \u01302P \u015f\u0259b\u0259k\u0259d\u0259ki h\u0259r bir routeri bilm\u0259k \u00fc\u00e7\u00fcn bir mar\u015frutla\u015fd\u0131r\u0131c\u0131 t\u0259l\u0259b etmir.";
