    t[3062] = "You can override the <a href=http://127.0.0.1:7658/help/images/>default appearance</a> of the directory listing by supplying an edited <a href=http://127.0.0.1:7658/.resources/jetty-dir.css>jetty-dir.css</a> file to set a global appearance. Note that this file will not be displayed in the webserver's directory listing. Files and directories prefixed with . and files named favicon.ico or files ending with ~ or .bak or .old will also be hidden from view (though still accessible). Note: To create hidden files with a . prefix on Windows, add a trailing . to the file or directory e.g. <code>.hidden.</code>; Windows explorer will then save the file with the correct name, removing the trailing dot in the process.";
    t[3063] = "<a href=http://127.0.0.1:7658/help/images/>Default g\u00f6r\u00fcn\u00fc\u015f\u00fc</a>,veril\u0259nl\u0259r bax\u0131\u015f\u0131n\u0131 d\u00fcz\u0259ld\u0259k <a href=http://127.0.0.1:7658/.resources/jetty-dir.css>jetty-dir.css</a> same file secure daslayaraq d\u00fcz\u0259ld\u0259 bil\u0259rsiniz. T\u0259bii ki burada stabil olaraq bu css fayl g\u00f6rs\u0259nmir. Birba\u015fa g\u00f6rm\u0259 (lakin h\u0259l\u0259 d\u0259 gizlid\u0259n \u00e7atd\u0131r\u0131lan) \u00fc\u00e7\u00fcn . d\u0259n ba\u015flayan fayllar v\u0259 qovluqlar, favicon.ico adlanan fayllar v\u0259 ya ~ il\u0259 v\u0259 ya .bak v\u0259 .old il\u0259 bit\u0259n fayllar g\u00f6z\u0259l g\u00f6r\u00fcnm\u0259zl\u0259r. G\u00f6st\u0259ril\u0259n xususiy\u0259t Windows \u00fc\u00e7\u00fcn .  il\u0259 ba\u015flayan gizli fayllar\u0131 yaratmaq \u00fc\u00e7\u00fcn ke\u00e7\u0259rli m\u0259s\u0259l\u0259dir. h\u0259r\u0259k\u0259t etm\u0259mi\u015f .-la bit\u0259n fayllar v\u0259 qovluqlara n\u00fcmun\u0259 kimi <code>.gizli.</code> \u0259lav\u0259 ed\u0259 bil\u0259rsiniz. Windows k\u0259\u015ffiyyat\u00e7\u0131s\u0131 bel\u0259likl\u0259 fayl\u0131 d\u00fczg\u00fcn adla yad\u0131rma\u011f\u0131, h\u0259r\u0259k\u0259t etm\u0259mi\u015f n\u00f6qt\u0259ni silm\u0259kd\u0259n ke\u00e7ir\u0259c\u0259k.";
