    t[3188] = "When set to true, additional functionality will be enabled in the console and the user will be able to edit settings directly on the <a href=/configadvanced>Advanced Configuration page</a>. Extra display options are provided in the <a href=/netdb>Network Database section</a>, including the <a href='/netdb?f=3'>Sybil Analysis tool</a>, and there are additional configuration options on the <a href=/configclients>Clients Configuration page</a>. This will also enable the installation of unsigned updates, manual configuration of the news URL, and additional sections on the sidebar.";
    t[3189] = "True olarak ayarland\u0131\u011f\u0131nda, konsolda ek i\u015flevler etkinle\u015ftirilecek ve kullan\u0131c\u0131lar <a href=/configadvanced>Geli\u015fmi\u015f Yap\u0131land\u0131rma sayfas\u0131nda</a> ayarlar\u0131 do\u011frudan d\u00fczenleyebileceklerdir. <a href=/netdb>A\u011f Veritaban\u0131 b\u00f6l\u00fcm\u00fcnde</a> ekstra g\u00f6r\u00fcnt\u00fcleme se\u00e7enekleri sunulmakta olup, bunlar aras\u0131nda <a href='/netdb?f=3'>Sybil Analiz arac\u0131</a> bulunmaktad\u0131r ve ayr\u0131ca <a href=/configclients>\u0130stemci Yap\u0131land\u0131rma sayfas\u0131nda</a> ek yap\u0131land\u0131rma se\u00e7enekleri bulunmaktad\u0131r. Bu ayr\u0131ca imzas\u0131z g\u00fcncellemelerin y\u00fcklenmesini, haber URL'sinin elle yap\u0131land\u0131r\u0131lmas\u0131n\u0131 ve kenar \u00e7ubu\u011funda ek b\u00f6l\u00fcmleri etkinle\u015ftirecektir.";
