    t[3302] = "This is an experimental network database tool for debugging and analysis. Do not panic even if you see warnings indicated. Possible \"threats\" are summarized, however these are unlikely to be real threats. If you see anything you would like to discuss with the devs, contact us on IRC #i2p-dev.";
    t[3303] = "Bu, diskussiya v\u0259 analiz \u00fc\u00e7\u00fcn eksperimental \u015f\u0259b\u0259k\u0259 veril\u0259nl\u0259r bazas\u0131 vasit\u0259sidir. G\u00f6st\u0259ril\u0259n x\u0259b\u0259rdarl\u0131qlar\u0131 g\u00f6rs\u0259n d\u0259 \u00e7axna\u015fma etm\u0259yin. M\u00fcmk\u00fcn \"t\u0259hdidl\u0259r\" \u00fcmumil\u0259\u015fdirilmi\u015fdir, lakin bunlar\u0131n h\u0259qiqi t\u0259hdidl\u0259ri olmas\u0131 ehtimal\u0131 azd\u0131r. Devs il\u0259 m\u00fczakir\u0259 etm\u0259k ist\u0259diyiniz bir \u015feyi g\u00f6rs\u0259niz, IRC #i2p-dev biziml\u0259 \u0259laq\u0259 saxlay\u0131n.";
