    t[3396] = "A fork of the <a href=http://www.klomp.org/snark/ class='sitelink external' target=_blank rel=noreferrer>Snark BitTorrent client</a> refactored for use on the I2P network. Usually supplied as part of the default suite of applications with Java I2P, and also available as a <a href=http://skank.i2p/#download class=sitelink target=_blank rel=noreferrer>standalone Java application</a>.";
    t[3397] = "<a href=http://www.klomp.org/snark/ class='sitelink external' target=_blank rel=noreferrer>Snark BitTorrent klientinin</a> I2P \u015f\u0259b\u0259k\u0259sind\u0259 istifad\u0259 \u00fc\u00e7\u00fcn refaktor edilmi\u015f fork. Genellikl\u0259 Java I2P-in standart proqram gurubunun bir hiss\u0259si \u015f\u0259klind\u0259 t\u0259qdim olunur v\u0259 h\u0259m\u00e7inin <a href=http://skank.i2p/#download class=sitelink target=_blank rel=noreferrer>ba\u011f\u0131ms\u0131z Java t\u0259tbiqi</a> \u015f\u0259klind\u0259 d\u0259 m\u00f6vcuddur.";
