    t[3416] = "If you are running the Tor Browser, you may use its Tor instance by configuring I2P to use: <i>Proxy type:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9150</code>.";
    t[3417] = "Tor Brauzerini i\u015fl\u0259dirsinizs\u0259, I2P-ni istifad\u0259 etm\u0259k \u00fc\u00e7\u00fcn konfiqurasiya etm\u0259kl\u0259 onun Tor n\u00fcmun\u0259sind\u0259n istifad\u0259 ed\u0259 bil\u0259rsiniz: <i>Proksi n\u00f6v\u00fc:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code>  <i>Port:</i> <code>9150</code>.";
