    t[3480] = "Bandwidth in/out";
    t[3481] = "Bant geni\u015fliyi";
    t[3482] = "This setting determines whether stats about our router are sporadically published to the NetDb. [Default is false]";
    t[3483] = "Bu parametr ruterimiz haqq\u0131nda statistik m\u0259lumatlar\u0131n NetDb-y\u0259 sporadik olaraq d\u0259rc edilib-edilm\u0259diyini m\u00fc\u0259yy\u0259n edir. [Standart yaland\u0131r]";
    t[3486] = "This is the number of peers your router has available for building client tunnels. It is generally in the range 8-30. Your fast peers are shown on the <a href='/profiles'>Profiles page</a>. <a href='/configstats#router.fastPeers'>[Enable graphing]</a>";
    t[3487] = "Bu, y\u00f6nl\u00fc\u011f\u00fcn\u00fcz\u00fcn istemci t\u00fcnelleri olu\u015fturmak i\u00e7in kullanabilece\u011fi akran say\u0131s\u0131n\u0131 belirtir. Genellikle 8-30 aral\u0131\u011f\u0131ndad\u0131r. H\u0131zl\u0131 akranlar\u0131n\u0131z <a href='/profiles'>Profiller sayfas\u0131nda</a> g\u00f6sterilir. <a href='/configstats#router.fastPeers'>[Grafiklemeyi etkinle\u015ftir]</a>";
    t[3488] = "Click the <i>Reseed from File</i> button";
    t[3489] = "<i>Fayldan yenil\u0259n</i> d\u00fcym\u0259sini bas\u0131n";
    t[3490] = "A variant of onion routing that encrypts multiple messages together to make it more difficult for attackers to perform traffic analysis and to increase the speed of data transfer. For more information, see the <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[3491] = "Zinaqor y\u00f6n\u0259ltm\u0259nin variant\u0131d\u0131r ki, h\u00fccumlucular\u0131n trafik analizi aparmaq v\u0259 m\u0259lumat k\u00f6\u00e7\u00fcrm\u0259 s\u00fcr\u0259tini art\u0131rmaq \u00fc\u00e7\u00fcn birg\u0259 bir ne\u00e7\u0259 mesaj\u0131 \u015fifr\u0259l\u0259yir. \u018flav\u0259 m\u0259lumat \u00fc\u00e7\u00fcn <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>online s\u0259n\u0259dl\u0259r\u0259</a> bax\u0131n.";
    t[3494] = "How to Harden Your WordPress Site";
    t[3495] = "WordPress sayt\u0131n\u0131z\u0131 nec\u0259 s\u0259rtl\u0259\u015fdirm\u0259k olar";
    t[3496] = "I2P Internals";
    t[3497] = "Al\u0259tl\u0259r v\u0259 Diaqnostika";
    t[3500] = "By default, I2P is supplied with a webserver to host your own anonymized website (traditionally referred to as an <i>eepsite</i>). Both the site and the I2P Router Console are running on a streamlined version of <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, customized for I2P.";
    t[3501] = "Varsay\u0131lan olaraq, \u01302P \u00f6z anonim sayt\u0131n\u0131z\u0131 (\u0259vv\u0259lc\u0259 eepsite adland\u0131r\u0131lan ) qeyri izl\u0259n\u0259n veb server il\u0259 t\u0259min edir. H\u0259m sayt, h\u0259m d\u0259 \u01302P Ruter Konsolu Jetty (https://en.wikipedia.org/wiki/Jetty_(web_server)) adlanan, \u01302P \u00fc\u00e7\u00fcn x\u00fcsusi t\u0259kmill\u0259\u015fdirilmi\u015f s\u0259naye versiyas\u0131 il\u0259 i\u015fl\u0259yir.";
    t[3504] = "This setting allows you to exclude older routers from your NetDb. Routers older than the default or the value you set will be deleted from the NetDb and banned for the duration of the router session. By default, routers older than 0.9.20 are excluded. Note: starting with I2P+ version 0.9.46+, only routers running very recent versions are used for building local tunnels. [Restart required]";
    t[3505] = "Bu parametr NetDb-d\u0259n k\u00f6hn\u0259 mar\u015frutla\u015fd\u0131r\u0131c\u0131lar\u0131 xaric etm\u0259y\u0259 imkan verir. Standart v\u0259 ya t\u0259yin etdiyiniz d\u0259y\u0259rd\u0259n daha b\u00f6y\u00fck mar\u015frutla\u015fd\u0131r\u0131c\u0131lar NetDb-d\u0259n silin\u0259c\u0259k v\u0259 router sessiyas\u0131n\u0131n m\u00fcdd\u0259ti \u0259rzind\u0259 qada\u011fan edil\u0259c\u0259k. Standart olaraq 0.9.20 -d\u0259n yuxar\u0131 olan mar\u015frutla\u015fd\u0131r\u0131c\u0131lar istisna edilir. Qeyd: 0.9.46 I2P  versiyas\u0131ndan ba\u015flayaraq, yerli tunell\u0259rin qurulmas\u0131 \u00fc\u00e7\u00fcn yaln\u0131z \u00e7ox son versiyalarla i\u015fl\u0259y\u0259n mar\u015frutla\u015fd\u0131r\u0131c\u0131lardan istifad\u0259 olunur. [Yenid\u0259n ba\u015flad\u0131n t\u0259l\u0259b olunur]";
    t[3508] = "HackerNews";
    t[3509] = "HackerNews";
