    t[3624] = "This setting determines whether or not the router should use the provided <i>blocklist.txt</i> file and any user configured blocklists to enable banning of routers by hash or ip address. Ranges and net masks are supported for IPv4 but not IPv6. See the <i>blocklist.txt</i> in your I2P+ application directory for more info. [Enabled by default, restart required]";
    t[3625] = "Bu parametr mar\u015frutla\u015fd\u0131r\u0131c\u0131n\u0131n t\u0259min edilmi\u015f blocklist.txt fayl\u0131ndan v\u0259 ist\u0259nil\u0259n istifad\u0259\u00e7i t\u0259r\u0259find\u0259n konfiqurasiya edilmi\u015f blok <i></i> siyah\u0131lar\u0131ndan istifad\u0259 edib-etm\u0259m\u0259sini m\u00fc\u0259yy\u0259n edir ki, bu da mar\u015frutla\u015fd\u0131r\u0131c\u0131lar\u0131n hash v\u0259 ya ip \u00fcnvan\u0131 il\u0259 qada\u011fan edilm\u0259sin\u0259 imkan verir. Diapazonlar v\u0259 xalis maskalar IPv4 \u00fc\u00e7\u00fcn d\u0259st\u0259kl\u0259nir, lakin IPv6 deyil. \u018ftrafl\u0131 m\u0259lumat <i></i> \u00fc\u00e7\u00fcn I2P  t\u0259tbiq kataloqunuzda blocklist.txt-\u0259 bax\u0131n. [Standart olaraq aktivdir, yenid\u0259n ba\u015flad\u0131n t\u0259l\u0259b olunur]";
