    t[3704] = "The router configuration options listed below are not available in the user interface, usually because they are rarely used or provide access to advanced settings that most users will not need. This is not a comprehensive list. Some settings will require a restart of the router to take effect. Note that all settings are case sensitive. You will need to edit your <code>router.config</code> file to add options, or, once you have added <code>routerconsole.advanced=true</code> to the router.config file, you may edit settings within the console on the <a href=/configadvanced>Advanced Configuration page</a>.";
    t[3705] = "A\u015fa\u011f\u0131da verilen y\u00f6nlendirici yap\u0131land\u0131rma se\u00e7enekleri kullan\u0131c\u0131 arabiriminde mevcut de\u011fildir, genellikle nadiren kullan\u0131l\u0131rlar veya \u00e7o\u011fu kullan\u0131c\u0131n\u0131n ihtiyac\u0131 olmayan geli\u015fmi\u015f ayarlara eri\u015fim sa\u011flarlar. Bu, kapsaml\u0131 bir liste de\u011fildir. Baz\u0131 ayarlar, y\u00f6nlendiriciyi yeniden ba\u015flatmay\u0131 gerektirecektir. T\u00fcm ayarlar\u0131n ayn\u0131 harfe duyarl\u0131 oldu\u011funu unutmay\u0131n. Se\u00e7enekler eklemek i\u00e7in <code>router.config</code> dosyan\u0131z\u0131 d\u00fczenlemeniz gerekecektir veya <code>router.config</code> dosyas\u0131na <code>routerconsole.advanced=true</code> ekledikten sonra konsol \u00fczerindeki <a href=/configadvanced>Geli\u015fmi\u015f Yap\u0131land\u0131rma sayfas\u0131ndan ayarlar\u0131 d\u00fczenleyebilirsiniz</a>.";
