    t[3781] = "\u018fksin\u0259, web server I2P \u015f\u0259b\u0259k\u0259si xaricind\u0259 \u0259m\u0259liyyatleri \u00fc\u00e7\u00fcn n\u0259qliyyat\u0131 geni\u015fl\u0259ndirm\u0259k \u00fc\u00e7\u00fcn c\u0259miyy\u0259t \u00fczr\u0259 \u0259laq\u0259l\u0259ri transfer etmir. \u00c7o\u011fu zaman bunu, webserveri b\u00fct\u00fcn aray\u00fczsl\u0259rd\u0259 (0.0.0.0) dinl\u0259nm\u0259k \u00fc\u00e7\u00fcn \u0259v\u0259zind\u0259 localhost (127.0.0.1) dinl\u0259m\u0259k \u00fc\u00e7\u00fcn konfiqurasiya ed\u0259r\u0259k ed\u0259 bil\u0259rsiniz.";
