    t[3961] = "\u0130\u015fi yenic\u0259 bitirdim";
    t[3962] = "Some IRC clients are configured to disconnect from the server if there's been no communication with the server for a period of time, which can sometimes be problematic for I2P IRC if the <i>ping timeout</i> value is set too low. Setting the ping timeout value in your client to a high value (e.g. 320 seconds) will often result in a more robust connection to the network. In hexchat you can configure the value by typing <code>/set net_ping_timeout 320</code>. This will write the value to your <code>hexchat.conf</code> file.";
    t[3963] = "B\u0259zi IRC m\u00fc\u015ft\u0259ril\u0259ri, hans\u0131sa bir vaxt \u0259rzind\u0259 server il\u0259 he\u00e7 bir \u0259laq\u0259 yoxdursa, serverd\u0259n ay\u0131rmas\u0131 konfiqurasiya edil\u0259 bil\u0259r, bu da baz\u0259n I2P IRC-\u00fc\u00e7\u00fcn m\u0259s\u0259l\u0259 yarada bil\u0259r, \u0259g\u0259r <i>ping timeout</i> qiym\u0259ti \u00e7ox a\u015fa\u011f\u0131 endiril\u0259rs\u0259. Ping timeout d\u0259y\u0259rini m\u00fc\u015ft\u0259rinizd\u0259 y\u00fcks\u0259k bir qiym\u0259t\u0259 (m\u0259s\u0259l\u0259n, 320 saniy\u0259) t\u0259yin ed\u0259r\u0259k, \u015f\u0259b\u0259k\u0259y\u0259 daha da davaml\u0131 bir qo\u015fulma il\u0259 n\u0259tic\u0259l\u0259nm\u0259 ed\u0259 bil\u0259rsiniz. Hexchat-d\u0259 qiym\u0259ti daxil ed\u0259r\u0259k qiym\u0259ti d\u00fcz\u0259ld\u0259 bil\u0259rsiniz <code>/set net_ping_timeout 320</ code>. Bu d\u0259y\u0259ri <code>hexchat.conf</ code> fayl\u0131n\u0131za qeyd ed\u0259c\u0259k.";
    t[3964] = "Run at Startup?";
    t[3965] = "Ba\u015flan\u011f\u0131cda qa\u00e7maq?";
    t[3972] = "Never";
    t[3973] = "He\u00e7 vaxt";
    t[3978] = "An <a href=/confignet#ipchange>optional configuration</a> that automatically changes your <a href=/netdb?r=.>router identity</a> and <a href=/confignet#udpconfig>external port</a> when the public ip address your system is on changes. This can prevent an adversary from correlating your router identity and ip address in scenarios where your ip address may change frequently, for example when you're running I2P on a laptop from multiple locations.";
    t[3979] = "Sizin sisteminizin oldu\u011fu umumi IP \u00fcnvan\u0131n\u0131n d\u0259yi\u015fm\u0259si hal\u0131nda avtomatik olaraq <a href=/confignet#ipchange>iste\u011fe ba\u011fl\u0131 yap\u0131land\u0131rmad\u0131r</a>, bu zaman <a href=/netdb?r=.>router identifikasiyas\u0131n\u0131</a> v\u0259 <a href=/confignet#udpconfig>qeyri-m\u00fctl\u0259q portu</a> d\u0259yi\u015fdirir. Bu, IP \u00fcnvan\u0131n\u0131z\u0131n s\u0259 frequently d\u0259yi\u015f\u0259 bil\u0259c\u0259yi m\u0259nada router identifikasiyas\u0131 v\u0259 IP \u00fcnvan\u0131n\u0131z\u0131n ay\u0131klanmas\u0131na qar\u015f\u0131 qoruyucu t\u0259dbirl\u0259r almaq \u00fc\u00e7\u00fcn could prevent. M\u0259s\u0259l\u0259n, I2P-ni bir ne\u00e7\u0259 m\u00f6vqeyd\u0259n laptoptan \u00e7al\u0131\u015fd\u0131r\u0131rs\u0131n\u0131z.";
    t[3982] = "The router is not configured to publish its address, therefore it does not expect incoming connections.";
    t[3983] = "Router \u00fcnvan\u0131n\u0131 d\u0259rc etm\u0259k \u00fc\u00e7\u00fcn konfiqurasiya olunmay\u0131b, ona g\u00f6r\u0259 d\u0259 daxil olan \u0259laq\u0259l\u0259ri g\u00f6zl\u0259mir.";
    t[3998] = "A command-line application supplied with I2P+ (Linux/MacOS) that is used to perform a <code>head</code> request on a specified http resource on the network, returning various response headers from the remote server. By default, eephead uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[3999] = "I2P+ (Linux/MacOS) il\u0259 t\u0259chiz edilmi\u015f bir komanda s\u0259tiri t\u0259tbiqidir ki, \u015f\u0259b\u0259k\u0259d\u0259ki m\u00fc\u0259yy\u0259n http resursuna <code>ba\u015fl\u0131q</code> t\u0259l\u0259bin\u0259 cavab olaraq uzaq serverd\u0259n m\u00fcxt\u0259lif cavab ba\u015fl\u0131qlar\u0131 qaytar\u0131r. \u018fsas\u0259n, eephead <code>127.0.0.1:4444</code> \u00fcz\u0259rind\u0259ki HTTP proksisi istifad\u0259 edir.";
