    t[4054] = "In order to access websites hosted on the I2P network, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P+ <b>HTTP</b> proxy, by default running on <code>127.0.0.1 port 4444</code>. For more help, see <a href=https://geti2p.net/htproxyports target=_blank rel=noreferrer>the configuration guide</a>, or <a href=/help/configuration#browserconfig>the mini-tutorial for Firefox</a>.";
    t[4055] = "\u01302P \u015f\u0259b\u0259k\u0259sind\u0259 yerl\u0259\u015f\u0259n veb saytlara daxil olmaq v\u0259 ist\u0259y\u0259 ba\u011fl\u0131 olaraq standart \u00e7\u0131x\u0131\u015f proksisi vasit\u0259sil\u0259 \u015f\u0259b\u0259k\u0259d\u0259ki veb saytlara qo\u015fularaq \u0130nternetd\u0259 yerl\u0259\u015f\u0259n veb saytlar\u0131 istifad\u0259 etm\u0259k \u00fc\u00e7\u00fcn brauzerini I2P+ <b>HTTP</b> proksisi il\u0259 yap\u0131land\u0131rman\u0131z laz\u0131md\u0131r. Bu, \u0259sas\u0259n <code>127.0.0.1 port 4444</code>-d\u0259 i\u015fl\u0259y\u0259n proksi il\u0259 h\u0259yata ke\u00e7irilir. \u018flav\u0259 k\u00f6m\u0259k \u00fc\u00e7\u00fcn <a href=https://geti2p.net/htproxyports target=_blank rel=noreferrer>qura\u015fd\u0131rma t\u0259limat\u0131n\u0131</a> v\u0259 ya <a href=/help/configuration#browserconfig>Firefox \u00fc\u00e7\u00fcn mini-t\u0259limat\u0131</a> bax\u0131n.";
