    t[4332] = "Note: The order of the declarations matters. The first threshold declaration for a given destination (whether explicit or listed in a referenced file) overrides any future thresholds for the same destination, whether explicit or listed in a file. Note: to apply a new filter file, the tunnel must be restarted after the location has been specified in the tunnel manager. Once configured, a definition file can be updated without requiring a restart of the target tunnel, although destinations that are blocked will persist until the tunnel is restarted.";
    t[4333] = "Qeyd: Bildiri\u015fl\u0259rin s\u0131ras\u0131n\u0131n vacibliyi vard\u0131r. M\u00f6vcud destinasiya \u00fc\u00e7\u00fcn ilk e\u015fik bildirisi (explicit v\u0259 ya istinad edil\u0259n s\u0259n\u0259dd\u0259ki) h\u0259m d\u0259 s\u0259n\u0259dd\u0259 g\u00f6st\u0259rilm\u0259si h\u0259m d\u0259 efektiv v\u0259 ya g\u00f6st\u0259rilm\u0259s\u0259 bel\u0259, yenid\u0259n daha sonra a\u015fkar edil\u0259n h\u0259r hans\u0131 bir e\u015fikd\u0259n (<i class=example>15/5</i>, <i class=example>60/60</i> kimi) daha g\u00fccl\u00fc biridir. Qeyd: yeni bir filtr fayl\u0131 t\u0259tbiq etmek \u00fc\u00e7\u00fcn, yerin t\u00fcnel meneceri t\u0259r\u0259find\u0259n g\u00f6st\u0259rilm\u0259sind\u0259n sonra t\u00fcnel yenid\u0259n ba\u015flad\u0131lmal\u0131d\u0131r. Konfiqurasiya edildikd\u0259n sonra, bir t\u0259yin fayl\u0131, h\u0259d\u0259f t\u00fcneld\u0259 yenid\u0259n ba\u015flamadan yenil\u0259n\u0259 bil\u0259r, lakin blok edilmi\u015f olan h\u0259d\u0259fl\u0259r t\u00fcnel yenid\u0259n ba\u015flan\u0131ld\u0131qda qal\u0131b qalacaq.";
