    t[4619] = "Payla\u015fman\u0131n geni\u015fliyi n\u0259 q\u0259d\u0259r y\u00fcks\u0259k olarsa, anonimliyinizi bir o q\u0259d\u0259r yax\u015f\u0131la\u015fd\u0131rar v\u0259 \u015f\u0259b\u0259k\u0259y\u0259 k\u00f6m\u0259k ed\u0259rsiniz.";
    t[4624] = "<b>Note:</b> On some Apache installations, the <a href=https://httpd.apache.org/docs/2.4/mod/mod_status.html target=_blank class='sitelink external'>mod_status</a> and <a href=https://httpd.apache.org/docs/2.4/mod/mod_info.html target=_blank class='sitelink external'>mod_info</a> modules are enabled by default. It is important to disable these, or otherwise protect access to the urls, to avoid compromising the anonymity and security of your server.";
    t[4625] = "<b>Qeyd:</b> B\u0259zi Apache qura\u015fd\u0131rmalar\u0131nda <a href=https://httpd.apache.org/docs/2.4/mod/mod_status.html target=_blank class='sitelink external'>mod_status</a> v\u0259 <a href=https://httpd.apache.org/docs/2.4/mod/mod_info.html target=_blank class='sitelink external'>mod_info</a> modullar\u0131 d\u0259yfl\u0259ndirilib. Serverinizin anonimliyi v\u0259 t\u0259hl\u00fck\u0259sizliyini saxlamaq \u00fc\u00e7\u00fcn, bu modullar\u0131 s\u00f6nd\u00fcrm\u0259k v\u0259 ya linkl\u0259r\u0259 giri\u015f\u0259 qoruyuculuq etm\u0259k \u00f6n\u0259mlidir.";
