    t[4697] = "IPv6 \u0259v\u0259zin\u0259 IPv4-\u0259 \u00fcst\u00fcnl\u00fck verin";
    t[4702] = "NTCP (NIO-based TCP) and NTCP2 are TCP-based network transports which use Java's NIO (New I/O) TCP implementation to deliver I2NP messages between routers on the network. NTCP2 improves the resistance of NTCP to various attacks and automated traffic identification methods. For more information, see the <a href=https://geti2p.net/en/docs/transport/ntcp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[4703] = "NTCP (NIO-\u0259 \u0259saslanan TCP) v\u0259 NTCP2, I2NP mesajlar\u0131n\u0131 \u015f\u0259b\u0259k\u0259d\u0259ki ruterd\u0259n rutera \u00e7atd\u0131rmaq \u00fc\u00e7\u00fcn Java'n\u0131n NIO (Yeni I/O) TCP t\u0259tbiqin\u0259 malik TCP \u0259sasl\u0131 \u015f\u0259b\u0259k\u0259 n\u0259qliyyat\u0131n\u0131 istifad\u0259 ed\u0259n \u015f\u0259b\u0259k\u0259 \u00fczr\u0259 n\u0259qliyyat\u0131 t\u0259msil edir. NTCP2, NTCPnin m\u00fcxt\u0259lif h\u00fccumlara v\u0259 avtomatik trafi\u011fi identifikasiya etm\u0259 y\u00f6nt\u0259ml\u0259rin\u0259 qar\u015f\u0131 dayanma\u011f\u0131n\u0131 yax\u015f\u0131la\u015fd\u0131r\u0131r. \u018ftrafl\u0131 m\u0259lumat \u00fc\u00e7\u00fcn, <a href=https://geti2p.net/en/docs/transport/ntcp class='sitelink external' target=_blank rel=noreferrer>onlayn s\u0259n\u0259dl\u0259r\u0259</a> bax\u0131n.";
    t[4708] = "You can use a recorder to log the destinations of aggressive clients to a specified file, and then use that same file to throttle them. The following snippet defines a filter that initially allows all connection requests, but if any single destination exceeds 180 requests in 60 seconds, it gets throttled down to 30 requests every 60 seconds:";
    t[4709] = "S\u0259ni qaydalamaq \u00fc\u00e7\u00fcn bir qeyd\u00e7ini istifad\u0259 m\u00fcmk\u00fcnd\u00fcrsiniz \u015fidd\u0259tli istifad\u0259l\u0259rin h\u0259d\u0259fl\u0259rini m\u00fc\u0259yy\u0259n bir s\u0259n\u0259d\u0259 qeyd etm\u0259k v\u0259 sonra h\u0259min fayl\u0131 \u0259haliy\u0259 qar\u015f\u0131 sah\u0259l\u0259m\u0259k \u00fc\u00e7\u00fcn. A\u015fa\u011f\u0131dak\u0131 k\u00fc\u00e7\u0259cik h\u0259d\u0259fi m\u00fc\u0259yy\u0259nl\u0259\u015fdirir: \u0259vv\u0259ll\u0259r b\u00fct\u00fcn \u0259laq\u0259 t\u0259l\u0259bl\u0259rin\u0259 izin verir, lakin \u0259g\u0259r h\u0259r hans\u0131 bir t\u0259k m\u0259nt\u0259q\u0259 60 saniy\u0259 180 t\u0259l\u0259b\u0259 qalxarsa, onu 60 saniy\u0259d\u0259 30 t\u0259l\u0259b\u0259y\u0259 azal\u0131r:";
