    t[4930] = "This setting, when configured with a path pointing at a valid blocklist file, enables an additional, user-configured blocklist to be loaded at router startup. [Disabled by default, restart required]";
    t[4931] = "Bu parametr, etibarl\u0131 blok siyah\u0131s\u0131 fayl\u0131na i\u015far\u0259 ed\u0259n bir yol il\u0259 konfiqurasiya edildikd\u0259, \u0259lav\u0259, istifad\u0259\u00e7i t\u0259r\u0259find\u0259n konfiqurasiya edilmi\u015f blok siyah\u0131s\u0131n\u0131n router ba\u015flan\u011f\u0131c\u0131nda y\u00fckl\u0259nm\u0259sin\u0259 imkan verir. [Standart olaraq deaktiv edin, yenid\u0259n ba\u015flad\u0131n t\u0259l\u0259b olunur]";
    t[4932] = "I2P+ supports custom theme overrides for the console, the tunnel manager, I2PSnark, SusiDNS and Susimail, permitting changes to the themes which are persistent after upgrades. In order to activate an override, create a css file named <code>override.css</code> with your theme modifications and place it in the relevant theme directory of the theme you wish to change, or rename one of the example files, and then hard refresh the browser. Note that the tunnel manager and the console share the same override.css. To deactivate an override, delete or rename the <code>override.css</code> file and then hard refresh the browser (usually Control + Shift + R).";
    t[4933] = "I2P+, konsol \u00fc\u00e7\u00fcn x\u00fcsusi m\u00f6vzu \u00fcz\u0259rind\u0259n ke\u00e7m\u0259yi, qalereya idar\u0259\u00e7isi, I2PSnark, SusiDNS v\u0259 Susimail daxil olmaqla bir s\u0131ra aparatlar \u00fc\u00e7\u00fcn d\u0259st\u0259kl\u0259yir. Bu d\u0259yi\u015fiklikl\u0259rin yenil\u0259nm\u0259l\u0259rd\u0259n sonra d\u0259rinlikli olaraq saxlan\u0131ld\u0131\u011f\u0131 m\u00f6vzu\u0259 izin verir. Ke\u00e7m\u0259yi etkinl\u0259\u015fdirm\u0259k \u00fc\u00e7\u00fcn <code>override.css</code> ad\u0131nda css fayl\u0131 yarad\u0131n v\u0259 m\u00f6vzu d\u0259yi\u015fiklikl\u0259rinizi buraya yerl\u0259\u015fdirin, v\u0259 ya n\u00fcmun\u0259 fayllardan birini yeniden adland\u0131r\u0131n v\u0259 sonra brauzeri say\u0131qland\u0131r\u0131n. Qeyd edin ki, qalereya idar\u0259\u00e7isi v\u0259 konsol eyni \u00fcst\u0259l\u0259yici.css fayl\u0131n\u0131 b\u00f6l\u00fc\u015f\u00fcr. Ke\u00e7m\u0259ni deaktiv etm\u0259k \u00fc\u00e7\u00fcn <code>override.css</code> fayl\u0131n\u0131 silin v\u0259 ya ad\u0131n\u0131 d\u0259yi\u015fdirin v\u0259 sonra brauzeri (ad\u0259t\u0259n Control + Shift + R) yenileyin.";
