    t[5201] = "Burada h\u0259r hans\u0131 bir parametrl\u0259ri d\u0259yi\u015fdirm\u0259k \u00fc\u00e7\u00fcn diqq\u0259tli olun. \"Router konsolu\" v\u0259 \"t\u0259tbiqi tunell\u0259r\" i2P-nin \u0259ks\u0259r istifad\u0259si \u00fc\u00e7\u00fcn t\u0259l\u0259b olunur. Yaln\u0131z inki\u015faf etmi\u015f istifad\u0259\u00e7il\u0259r bunlar\u0131 d\u0259yi\u015fdirm\u0259lidirl\u0259r.";
