    t[5238] = "An unmaintained I2P plugin that provides serverless, end-to-end encrypted e-mail within the I2P network. For more information, see <a href=http://bote.i2p/ class=sitelink target=_blank rel=noreferrer>http://bote.i2p/</a>. Source code is available on <a href=https://github.com/i2p/i2p.i2p-bote class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[5239] = "I2P a\u011f\u0131 i\u00e7inde sunucusuz, u\u00e7tan uca \u015fifrelenmi\u015f e-posta sa\u011flayan bak\u0131ms\u0131z bir I2P eklentisi. Daha fazla bilgi i\u00e7in <a href=http://bote.i2p/ class=sitelink target=_blank rel=noreferrer>http://bote.i2p/</a> sayfas\u0131na bak\u0131n. Kaynak kodu <a href=https://github.com/i2p/i2p.i2p-bote class='sitelink external' target=_blank rel=noreferrer>github</a> \u00fczerinde bulunabilir.";
