    t[5514] = "If after a few minutes of uptime your router is indicating 0 Active Peers and 0 Known Peers, with a notification in the sidebar that you need to check your network connection, verify that you can access the internet. If your internet connection is functional, you may need to unblock Java in your firewall. Otherwise, you may need to reseed your I2P router. Visit the <a href=/configreseed#reseedconfig>Reseed Configuration page</a> and click the <i>Save Changes and Reseed Now</i> button. For more information, see the <a href=#reseedhelp>Reseed help section</a> above.";
    t[5515] = "H\u0259yat d\u00f6vr\u00fcnd\u0259n sonra bir ne\u00e7\u0259 d\u0259qiq\u0259 h\u0259l\u0259 d\u0259sliyin 0 Aktiv F\u0259rdil\u0259r v\u0259 0 Tan\u0131nm\u0131\u015f F\u0259rdil\u0259r g\u00f6st\u0259rilir, yana\u015fmada sizin \u015f\u0259b\u0259k\u0259 ba\u011flant\u0131n\u0131z\u0131 yoxlamaq \u00fc\u00e7\u00fcn bir x\u0259b\u0259rdarla\u015fma varsa v\u0259 ya internet\u0259 giri\u015finiz olmad\u0131\u011f\u0131 halda bunu yoxlay\u0131n. \u0130nternet ba\u011flant\u0131n\u0131z funksionald\u0131rsa, Java-n\u0131 qoruyucu divar\u0131n\u0131zda qeyd\u0259 almaq laz\u0131m ola bil\u0259r. \u018fks halda, I2P d\u0259routerinizi yenid\u0259n t\u0259krarlamaq laz\u0131m ola bil\u0259r. <a href=/configreseed#reseedconfig>T\u0259krar Etm\u0259 Konfiqurasiya s\u0259hif\u0259sini</a> ziyar\u0259t edin v\u0259 <i>D\u0259yi\u015fiklikl\u0259ri Yadda Saxla v\u0259 \u0130ndi Bu\u011fda\u015fd\u0131rma</i> d\u00fcym\u0259sin\u0259 bas\u0131n. \u018ftrafl\u0131 m\u0259lumat \u00fc\u00e7\u00fcn, yuxar\u0131da olan <a href=#reseedhelp>T\u0259krar Etm\u0259 k\u00f6m\u0259k b\u00f6lm\u0259sin\u0259</a> bax\u0131n.";
    t[5518] = "A higher level socket API for clients. Only opened when a SAM V3 client requests a UDP session. Can be enabled/disabled on the <a href=/configclients> Client Configuration page</a>. Can be changed in the <code>clients.config</code> file with the SAM command line option <code>sam.udp.port=nnnn</code>.";
    t[5519] = "M\u00fc\u015ft\u0259ri \u00fc\u00e7\u00fcn daha y\u00fcks\u0259k s\u0259viyy\u0259li soket API. Yaln\u0131z SAM V3 m\u00fc\u015ft\u0259ri UDP sessiyas\u0131 t\u0259l\u0259b etdiyind\u0259 yaln\u0131z a\u00e7\u0131l\u0131r. <a href=/configclients>M\u00fc\u015ft\u0259ri Konfiqurasiya s\u0259hif\u0259sind\u0259n</a> ba\u015flatmaq / s\u00f6nd\u00fcrm\u0259k m\u00fcmk\u00fcnd\u00fcr. SAM komandas\u0131 il\u0259 <code>sam.udp.port=nnnn</code> SAM komanda s\u0259tiri se\u00e7iml\u0259ri il\u0259 <code>clients.config</code> faylda d\u0259yi\u015fdiril\u0259 bil\u0259r. ";
    t[5526] = "If you want your site to feel responsive, image compression is essential when hosting large images. Using a service like <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> to compress your png and jpeg images will often result in much smaller files with minimal loss of quality. In some situations the webp format can best jpegs, generating smaller files with approximately the same or better visual fidelity, and has wide browser support. Also consider using svgs instead of bitmaps for icons and illustrations - they're often smaller than the equivalent bitmap file (run them through a service like <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> to remove unneeded cruft), scale without loss of quality, and can be gzipped by your webserver.";
    t[5527] = "\u018fg\u0259r \u00f6z sayt\u0131n\u0131z\u0131n daha \u00e7\u0259yird\u0259 oldu\u011funu hiss etm\u0259k ist\u0259yirsinizs\u0259, b\u00f6y\u00fck \u015f\u0259kill\u0259ri yerl\u0259\u015fdirdiyiniz zaman \u015f\u0259kil s\u0131x\u0131\u015fd\u0131rmas\u0131 \u0259sas olduqda vacibdir. PNG v\u0259 JPEG \u015f\u0259kill\u0259rinizi s\u0131x\u0131\u015fd\u0131rma xidm\u0259tl\u0259rind\u0259n istifad\u0259 etm\u0259k (m\u0259s\u0259l\u0259n, <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a>) genellikl\u0259 daha ki\u00e7ik fayllara (azad\u0259siz keyfiyy\u0259t itkisind\u0259n as\u0131l\u0131 olaraq) s\u0259b\u0259b ola bil\u0259r. B\u0259zi hallarda, webp format\u0131 yantan\u0131n \u00fcst\u00fcn qar\u015f\u0131s\u0131n\u0131 ala bil\u0259r, yax\u015f\u0131la\u015fan dildirsizlikl\u0259 daha ki\u00e7ik fayllar yarad\u0131r v\u0259 geni\u015f brauzer d\u0259st\u0259yi il\u0259 t\u0259min edilir. H\u0259m\u00e7inin, ikonlar v\u0259 t\u0259svirl\u0259r \u00fc\u00e7\u00fcn bitmaps fayllar\u0131n yerin\u0259 svgl\u0259ri istifad\u0259 etm\u0259yi d\u00fc\u015f\u00fcn\u00fcn \u2013 onlar adilikd\u0259n daha ki\u00e7ik olurlar (<a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> kimil\u0259rind\u0259n ke\u00e7irin unudulmu\u015f l\u0259\u015fdlik elementl\u0259rini silm\u0259k \u00fc\u00e7\u00fcn), adilik itkil\u0259ri olmadan \u00e7apalarlar, v\u0259 veb serveriniz t\u0259r\u0259find\u0259n gzip edil\u0259 bil\u0259rl\u0259r.";
    t[5528] = "UPnP disabled on the device";
