    t[5536] = "By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels (for performance reasons) and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i> in the sidebar under Service Tunnels and on the <a href=/tunnels>Tunnels page</a>.";
    t[5537] = "\u018fks\u0259r istemci xidm\u0259tl\u0259riniz (po\u00e7t, http proxy, IRC) \u0259sas\u0259n eyni t\u0259kanlar d\u0259sti il\u0259 b\u00f6l\u00fc\u015fd\u00fcr (performans s\u0259b\u0259bind\u0259n dolay\u0131) v\u0259 <i>Shared Clients</i> / <i>Shared Clients(DSA)</i> olaraq siyah\u0131ya -bar c\u0259dv\u0259ld\u0259ni \u2014\u0259d\u0259bilirsiniz, bunlar da Xidm\u0259t T\u0259kanlar\u0131 alt\u0131nda v\u0259 <a href=/tunnels>T\u0259kan s\u0259hif\u0259</a>sin\u0259.";
