    t[5692] = "Manually edit peers and view banned peers and blocklist";
    t[5693] = "H\u0259mya\u015f\u0131dlar\u0131 \u0259l il\u0259 redakt\u0259 edin v\u0259 qada\u011fan edilmi\u015f h\u0259mya\u015f\u0131dlara v\u0259 blok siyah\u0131s\u0131na bax\u0131n";
    t[5712] = "Firewalled with Inbound TCP Enabled";
    t[5713] = "G\u0259l\u0259n TCP Aktivl\u0259\u015fdirilmi\u015f Firewalled";
    t[5716] = "Open <a href=/confignet#udpconfig>I2P+'s port</a> on your modem, router and/or firewall(s) for better connectivity (ideally both UDP and TCP). More information on how to go about port forwarding can be found at <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, in addition to our forums and IRC channels listed below. Note that I2P does not support connecting to the internet via an http or socks proxy [patches welcome!], though you can connect to proxies via I2P itself once connected to the network.";
    t[5717] = "Daha yax\u015f\u0131 \u0259laq\u0259 \u00fc\u00e7\u00fcn modem, ruter v\u0259/veya firewall-lar\u0131n\u0131zda <a href=/confignet#udpconfig>I2P+'nin portunu</a> a\u00e7\u0131n (ideally both UDP and TCP). Port y\u00f6nl\u0259ndirm\u0259 il\u0259 ba\u011fl\u0131 \u0259trafl\u0131 m\u0259lumat <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a> veb s\u0259hif\u0259sind\u0259, a\u015fa\u011f\u0131dadak\u0131 forumlar\u0131m\u0131z v\u0259 IRC kanallar\u0131m\u0131zda tap\u0131la bil\u0259r. Qeyd ed\u0259k ki, I2P internet\u0259 proxy il\u0259 birl\u0259\u015fm\u0259yi (http v\u0259 ya socks proxy) d\u0259st\u0259kl\u0259m\u0259z [yamalar qar\u015f\u0131lan\u0131r!], ancaq \u01302P-d\u0259 bir q\u0259d\u0259r bir\u0259 ba\u011fland\u0131qdan sonra \u01302P \u00f6z\u00fc \u00fcz\u0259rind\u0259n proksi il\u0259 birl\u0259\u015f\u0259 bil\u0259rsiniz.";
    t[5730] = "A tunnel filter can provide protection against denial of service attacks, without otherwise interrupting the service for genuine users, either in conjunction with the tunnel throttler or as an alternative strategy. It can also be used to log access to a hosted service to determine if the server is under attack, or simply to log all visitors by I2P destination. Additionally, a filter can function simultaneously as a whitelist and blacklist making it more flexible than the Tunnel Manager's access list controls. Note that multiple server tunnels can share a single filter file if you wish to implement a global filter.";
    t[5731] = "Bir t\u00fcnel filteri h\u00fccumsuzlaqla olan m\u00fcbariz\u0259y\u0259 k\u00f6m\u0259k ed\u0259 bil\u0259r, lakin xidm\u0259tl\u0259ri qaydalar olmam\u0131\u015f istifad\u0259\u00e7il\u0259r \u00fc\u00e7\u00fcn m\u00fcv\u0259qq\u0259ti k\u0259silikl\u0259r yaratmadan, ya t\u00fcnelin h\u0131zland\u0131r\u0131c\u0131 il\u0259 birg\u0259 ya da alternativ strategiya olaraq istifad\u0259 edil\u0259r\u0259k. H\u0259m\u00e7inin, bu filter\u0259 qeyd edil\u0259n bir m\u0259nt\u0259q\u0259y\u0259 olan giri\u015fl\u0259ri yadda\u015fa alaraq, server\u0259 olan h\u00fccuma n\u0259zar\u0259t edilir, v\u0259 ya sad\u0259c\u0259 I2P m\u0259nt\u0259q\u0259sin\u0259 g\u00f6r\u0259 b\u00fct\u00fcn m\u00fc\u0259llifl\u0259ri yadda\u015fa almaq \u00fc\u00e7\u00fcn istifad\u0259 edil\u0259 bil\u0259r. Filter, birba\u015fa qeyd edilmi\u015f siyah\u0131 v\u0259 qara siyah\u0131 kimi funksiyalar\u0131n\u0131 eyni anda yerin\u0259 yetir\u0259r\u0259k Tunnell\u0259r M\u0259necerinin giri\u015f siyah\u0131s\u0131 idar\u0259sin\u0259 nisb\u0259t\u0259n daha da esneklik g\u00f6st\u0259rir. Global filter t\u0259min etm\u0259k ist\u0259yirsinizs\u0259, bir ne\u00e7\u0259 server t\u00fcneli eyni filter fayl\u0131n\u0131 b\u00f6l\u00fc\u015f\u0259 bil\u0259r.";
