    t[6214] = "Do not reveal this file to unknown users, as it contains sensitive data (100 RouterInfo files) from your own I2P router which potentially could be used by an adversary to decloak your identity. In order to protect your anonymity: you should wait for a few hours/days before sharing the file with your trusted friend. It is also advisable to use this procedure sparingly (no more than once a week).";
    t[6215] = "Bu fayl\u0131 tan\u0131nmayan istifad\u0259\u00e7il\u0259r\u0259 a\u00e7\u0131qlama\u015f\u0131n, \u00e7\u00fcnki o, m\u00fczakir\u0259li melumatlar\u0131 (100 RouterInfo fayl\u0131) avversar t\u0259r\u0259find\u0259n sizin kimliyinizi a\u00e7maq \u00fc\u00e7\u00fcn istifad\u0259 edil\u0259 bil\u0259r. M\u0259xsus m\u00fchafiz\u0259d\u0259 ciddiy\u0259tli olan anonimliyinizi qorumaq \u00fc\u00e7\u00fcn: fayl\u0131 etibarl\u0131 dostunuzla payla\u015fmazdan \u0259vv\u0259l bir ne\u00e7\u0259 saat/g\u00fcn g\u00f6zl\u0259m\u0259lisiniz. Bu proseduru \u0259n \u00e7ox bir h\u0259ft\u0259d\u0259 bir d\u0259f\u0259 istifad\u0259 etm\u0259k\u0259 qadir olmaq da m\u0259sl\u0259h\u0259tdir.";
