    t[6382] = "Note: To enhance your security when browsing .i2p sites, you may wish to consider installing an addon to prevent Javascript from running in the browser such as <a href=https://addons.mozilla.org/en-US/firefox/addon/noscript/ target=_blank rel=noreferrer class='sitelink external'>NoScript</a>, though it's recommended to whitelist the address I2P+ is running on to enable various router console enhancements. In addition, an addon that prevents requests to offsite resources is also recommended, for example <a href=https://addons.mozilla.org/en-US/firefox/addon/umatrix/ target=_blank rel=noreferrer class='sitelink external'>uMatrix</a>.";
    t[6383] = "Not: .i2p sitelerine g\u00f6z atarken g\u00fcvenli\u011finizi art\u0131rmak i\u00e7in <a href=https://addons.mozilla.org/en-US/firefox/addon/noscript/ target=_blank rel=noreferrer class='sitelink external'>NoScript</a> gibi taray\u0131c\u0131da Javascript'in \u00e7al\u0131\u015fmas\u0131n\u0131 engelleyen bir eklenti y\u00fcklemeyi d\u00fc\u015f\u00fcnebilirsiniz. Bununla birlikte, \u00e7e\u015fitli y\u00f6nlendirici konsol geli\u015ftirmelerini etkinle\u015ftirmek i\u00e7in I2P+ adresinin beyaz listesini olu\u015fturman\u0131z \u00f6nerilir. Ek olarak, harici kaynaklara yap\u0131lan istekleri engelleyen bir eklenti de \u00f6nerilir, \u00f6rne\u011fin <a href=https://addons.mozilla.org/en-US/firefox/addon/umatrix/ target=_blank rel=noreferrer class='sitelink external'>uMatrix</a>.";
