    t[6762] = "I2P+ may be slow to integrate into network the first time you run it as it bootstraps into the network and learns of additional peers. The longer your I2P+ router is running, the better it will perform, so try and keep your router on as long as you can, 24/7 if possible! If, after 30 minutes, your <i>Active: [connected/recent]</i> count still has less than 10 peers, or your total number of <i>Integrated</i> peers is less than 5, there are several things you can do to check for problems:";
    t[6763] = "I2P+ ilk d\u0259f\u0259 i\u015fl\u0259tdiyiniz zaman \u015f\u0259b\u0259k\u0259y\u0259 inteqrasiya olma\u011fa yava\u015f ola bil\u0259r, \u015f\u0259b\u0259k\u0259y\u0259 ba\u011flan\u0131r v\u0259 \u0259lav\u0259 nodlar\u0131 \u00f6yr\u0259nir. I2P+ y\u00f6nl\u0259ndiriciniz ne\u00e7\u0259m\u00fcdd\u0259tdir i\u015fl\u0259yir v\u0259 bu m\u00fcdd\u0259t art\u0131q oldu\u011fuqca yax\u015f\u0131 saxlan\u0131lmal\u0131d\u0131r, m\u00fcmk\u00fcn oldu\u011fu q\u0259d\u0259r routeri 24 saat a\u00e7\u0131q saxlay\u0131n! 30 d\u0259qiq\u0259d\u0259n sonra iwxaslar C\u0259mi <i>Active: [connected/recent]</i> 10 q\u0259d\u0259r ulduzlara, yaxud C\u0259mi <i>Integrated</i> q\u0259d\u0259r inteqrasiya olmu\u015f ulduz say\u0131na sahib deyilsinizs\u0259, m\u00fc\u0259yy\u0259n probleml\u0259ri yoxlamaq \u00fc\u00e7\u00fcn bir ne\u00e7\u0259 \u015fey ed\u0259 bil\u0259rsiniz:";
