    t[6943] = "Y\u00fcks\u0259k tutumlu";
    t[6944] = "A java implementation of a Tor client, available as an I2P plugin. Can be used as the default <i>outproxy</i> if configured in the relevant SOCKS or HTTP client tunnel in the <i>Tunnel Manager</i>. Available from <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. Source code is available on <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6945] = "Tor istemcisinin bir Java t\u0259limat\u0131, I2P plugini kimi m\u00f6vcuddur. \u018fg\u0259r \u0259laq\u0259li SOCKS v\u0259 ya HTTP ist\u0259mci t\u00fcnelind\u0259 <i>Tunnel Manager</i>-da t\u0259nziml\u0259ndirilm\u0259kd\u0259dirs\u0259, \u0259ks\u0259r halda v\u0259zif\u0259siz <i>outproxy</i> kimi istifad\u0259 edil\u0259 bil\u0259r. <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a> \u00fcnvan\u0131ndan \u0259ld\u0259 edil\u0259 bil\u0259r. M\u0259nb\u0259 kodu <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a> \u00fcnvan\u0131nda m\u00f6vcuddur.";
    t[6952] = "IPv4 Addresses";
    t[6953] = "IPv4 \u00dcnvanlar\u0131";
    t[6956] = "This section indicates your average bandwidth speeds and total usage for the session. All values are in bytes per second. You may change your bandwidth limits on the <a href='/config'>Bandwidth Configuration page</a>. The more bandwidth you make available, the more you help the network and improve your own anonymity, so please take the time to review the settings. If you are unsure of your network's speed, using a service such as <a href='http://speedtest.net/'>SpeedTest</a> or similar will give you a good indication of your bandwidth capability. Your upstream share amount (KBps Out) will determine your overall contribution to the network. Bandwidth is <a href='/graphs'>graphed</a> by default.";
    t[6957] = "Bu b\u00f6l\u00fcm, ortalama bant geni\u015flik h\u0131z\u0131n\u0131z\u0131 ve oturumunuz i\u00e7in toplam kullan\u0131m\u0131n\u0131z\u0131 g\u00f6sterir. T\u00fcm de\u011ferler saniye ba\u015f\u0131na byte cinsinden verilir. Bant geni\u015fli\u011fi s\u0131n\u0131rlar\u0131n\u0131z\u0131 <a href='/config'>Bant Geni\u015fli\u011fi Yap\u0131land\u0131rma</a> sayfas\u0131ndan de\u011fi\u015ftirebilirsiniz. Daha fazla bant geni\u015fli\u011fi sa\u011flaman\u0131z, a\u011f\u0131 desteklemenize ve kendi anonimli\u011finizi art\u0131rman\u0131za yard\u0131mc\u0131 olur, bu nedenle ayarlar\u0131 g\u00f6zden ge\u00e7irmek i\u00e7in l\u00fctfen zaman ay\u0131r\u0131n. A\u011f h\u0131z\u0131n\u0131zdan emin de\u011filseniz, <a href='http://speedtest.net/'>SpeedTest</a> veya benzeri bir hizmet kullanarak bant geni\u015fli\u011fi yetenekleriniz hakk\u0131nda iyi bir fikir edinebilirsiniz. Y\u00fckleme pay\u0131n\u0131z (KB/sn Cikis) a\u011fa genel katk\u0131n\u0131z\u0131 belirleyecektir. Bant geni\u015fli\u011fi varsay\u0131lan olarak <a href='/graphs'>grafile\u015ftirilir</a>.";
