    t[7004] = "This setting allows you to configure the minimum number of hosted participating tunnels before the router starts to reject tunnel requests based on anticipated bandwidth requirements. [Default is 100 if system is running Android, 800 if system is running on ARM and less than 4 cores available, 1200 if system is running on ARM and 4 or more cores available, otherwise 2500]";
    t[7005] = "Bu parametrl\u0259r router g\u00f6zl\u0259nil\u0259n bant geni\u015fliyi t\u0259l\u0259bl\u0259rin\u0259 \u0259sas\u0259n tunel sor\u011fular\u0131n\u0131 r\u0259dd etm\u0259y\u0259 ba\u015flamazdan \u0259vv\u0259l ev sahibliyi edil\u0259n i\u015ftirak\u00e7\u0131 tunell\u0259rinin minimal say\u0131n\u0131 konfiqurasiya etm\u0259y\u0259 imkan verir. [Sistem Android il\u0259 i\u015fl\u0259yirs\u0259 standart 100, QOL il\u0259 i\u015fl\u0259yirs\u0259 800 v\u0259 4-d\u0259n az n\u00fcv\u0259 m\u00f6vcuddursa 1200, QOL v\u0259 4 v\u0259 ya daha \u00e7ox n\u00fcv\u0259 il\u0259 i\u015fl\u0259yirs\u0259 \u0259ks halda 2500]";
    t[7012] = "Delete key";
