    t[7022] = "This setting (in milliseconds) allows you to manually configure the queue delay target value for the CoDel queue management system. Default is 50ms. [Restart required]";
    t[7023] = "Bu parametr (millisaniy\u0259 \u0259rzind\u0259) CoDel n\u00f6vb\u0259 idar\u0259etm\u0259 sistemi \u00fc\u00e7\u00fcn n\u00f6vb\u0259 gecikm\u0259 h\u0259d\u0259finin d\u0259y\u0259rini \u0259l il\u0259 konfiqurasiya etm\u0259y\u0259 imkan verir. Standart 50 m-dir. [Yenid\u0259n ba\u015flad\u0131n t\u0259l\u0259b olunur]";
    t[7030] = "In order to maintain anonymity, it is recommended to update using the I2P http proxy. If the news or I2P update is hosted on I2P, using the proxy will be necessary.";
    t[7031] = "Anonimliyi qorumaq \u00fc\u00e7\u00fcn i2P http proxy istifad\u0259 ed\u0259r\u0259k yenil\u0259m\u0259k t\u00f6vsiy\u0259 olunur. X\u0259b\u0259r v\u0259 ya i2P yenil\u0259m\u0259si i2P-d\u0259 ev sahibliyi edirs\u0259, proxy istifad\u0259 etm\u0259k laz\u0131md\u0131r.";
    t[7054] = "A threshold to apply to remote destinations listed in a file";
    t[7055] = "Bir dosyada listelenen uzak hedeflere uygulanacak bir e\u015fik";
    t[7062] = "The su3 format is preferred, as it will be verified as signed by a trusted source.";
    t[7063] = "Su3 format\u0131na \u00fcst\u00fcnl\u00fck verilir, \u00e7\u00fcnki onun etibarl\u0131 m\u0259nb\u0259 t\u0259r\u0259find\u0259n imzaland\u0131\u011f\u0131 t\u0259sdiql\u0259n\u0259c\u0259k.";
    t[7064] = "Specify hostname or IP address";
