    t[7073] = "\u018fngin \u00f6lk\u0259l\u0259r";
    t[7076] = "However, if you experience a tunnel failure, all your services will go offline at the same time, so in some scenarios you may wish to configure client services to use their own set of tunnels.";
    t[7077] = "Lakin tunel nasazl\u0131\u011f\u0131 il\u0259 qar\u015f\u0131la\u015fsan\u0131z, b\u00fct\u00fcn xidm\u0259tl\u0259riniz eyni vaxtda oflayn olacaq, ona g\u00f6r\u0259 d\u0259 b\u0259zi ssenaril\u0259rd\u0259 siz m\u00fc\u015ft\u0259ri xidm\u0259tl\u0259rini \u00f6z tunel d\u0259stl\u0259rind\u0259n istifad\u0259 etm\u0259k \u00fc\u00e7\u00fcn konfiqurasiya etm\u0259k ist\u0259y\u0259 bil\u0259rsiniz.";
