    t[7158] = "I2P does not work well behind this type of firewall. You will probably not be able to accept inbound connections, which will limit your participation in the network.";
    t[7159] = "I2P i\u015f bu n\u00f6v sonatardan arxalar\u0131nda d\u00fczg\u00fcn i\u015fl\u0259mir. Yax\u0131n q\u0259bild\u0259n g\u0259l\u0259n birl\u0259\u015fm\u0259l\u0259rin q\u0259bul edilm\u0259sin\u0259 imkan verm\u0259m\u0259k ehtimal\u0131 var, bu is\u0259 \u015f\u0259b\u0259k\u0259d\u0259 i\u015ftirak\u0131n\u0131z\u0131 m\u0259hdudla\u015fd\u0131racaqd\u0131r.";
    t[7166] = "The I2P Client Protocol (I2CP) enables external applications (clients) to communicate with I2P over single TCP socket, by default using port 7654. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7167] = "I2P M\u00fc\u015ft\u0259ri Protokolu (I2CP) xarici t\u0259tbiql\u0259rin (m\u00fc\u015ft\u0259ril\u0259rin) birbiri il\u0259 iki router aras\u0131nda mesajlar\u0131n k\u00f6\u00e7\u00fcr\u00fclm\u0259sin\u0259 imkan yarad\u0131r, \u00fcmumiyy\u0259tl\u0259, 7654 n\u00f6mr\u0259li port istifad\u0259 olunur. \u018flav\u0259 m\u0259lumat \u00fc\u00e7\u00fcn <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>online s\u0259n\u0259dl\u0259r\u0259</a> m\u00fcraci\u0259t edin.";
    t[7168] = "Queue Totals";
    t[7169] = "N\u00f6vb\u0259 C\u0259mi";
    t[7170] = "This setting determines which transport takes priority when communicating with peers. By default, NTCP is favored over UDP (SSU). By setting the value to true, UDP will be favored unless a pre-existing NTCP connection exists; when set to always, UDP will always be used regardless of any pre-existing NTCP connection. [Default is false]";
    t[7171] = "Bu parametr h\u0259mkarlar il\u0259 \u00fcnsiyy\u0259t zaman\u0131 hans\u0131 n\u0259qliyyat\u0131n \u00fcst\u00fcnl\u00fck t\u0259\u015fkil etdiyini m\u00fc\u0259yy\u0259n edir. Standart olaraq, MTCP UDP-d\u0259n (SDU) \u00fcst\u00fcn tutulur. D\u0259y\u0259ri do\u011fru t\u0259yin etm\u0259kl\u0259 \u0259vv\u0259lc\u0259d\u0259n m\u00f6vcud NTCP ba\u011flant\u0131s\u0131 m\u00f6vcud olmayana q\u0259d\u0259r \u00dcP\u0130-y\u0259 \u00fcst\u00fcnl\u00fck veril\u0259c\u0259k; h\u0259r zaman t\u0259yin edildikd\u0259, h\u0259r hans\u0131 \u0259vv\u0259lc\u0259d\u0259n m\u00f6vcud NTCP ba\u011flant\u0131s\u0131ndan as\u0131l\u0131 olmayaraq \u00dcP\u0130 h\u0259mi\u015f\u0259 istifad\u0259 edil\u0259c\u0259k. [Standart yanl\u0131\u015fd\u0131r]";
    t[7174] = "Translation Status";
