    t[7189] = "Tunel filtrl\u0259ri";
    t[7194] = "You have not configured inbound TCP with a hostname and port on the Network Configuration page, however you have disabled UDP.";
    t[7195] = "Siz \u015e\u0259b\u0259k\u0259 Konfiqurasiyas\u0131 s\u0259hif\u0259sind\u0259 host ad\u0131 v\u0259 port il\u0259 daxil olan TCP-ni konfiqurasiya etm\u0259misiniz, lakin UDP-ni deaktiv etmisiniz.";
    t[7200] = "Certificates are used to authenticate encrypted services running on the network, provision optional SSL for hosted services and the router console, or provide proof of ownership of a router family.";
    t[7201] = "Sertifikatlar \u015f\u0259b\u0259k\u0259d\u0259 i\u015fl\u0259y\u0259n \u015fifr\u0259l\u0259nmi\u015f xidm\u0259tl\u0259rin identifikasiyas\u0131, ev sahibliyi edilmi\u015f xidm\u0259tl\u0259r v\u0259 router konsolu \u00fc\u00e7\u00fcn qeyri-m\u0259cburi SSL-in t\u0259min edilm\u0259si v\u0259 ya router ail\u0259sin\u0259 m\u0259xsuslu\u011fun s\u00fcbutu \u00fc\u00e7\u00fcn istifad\u0259 olunur.";
