    t[7267] = "Router v\u0259 i\u015fl\u0259y\u0259n m\u00fchit haqq\u0131nda m\u0259lumatlara bax\u0131n";
    t[7268] = "A guide to some of the less-used configuration settings";
    t[7269] = "B\u0259zi az istifad\u0259 edil\u0259n konfiqurasiya parametrl\u0259ri \u00fc\u00e7\u00fcn b\u0259l\u0259d\u00e7i";
