    t[7284] = "The data gathered is quantized over a 1 minute period, so should just be used as an estimate.";
    t[7285] = "Toplanm\u0131\u015f m\u0259lumatlar 1 d\u0259qiq\u0259lik m\u00fcdd\u0259t \u0259rzind\u0259 kvantla\u015fd\u0131r\u0131l\u0131r, ona g\u00f6r\u0259 d\u0259 sad\u0259c\u0259 t\u0259xmin kimi istifad\u0259 edilm\u0259lidir.";
    t[7292] = "When set to true, I2P runs without network connectivity, which is helpful if you are constantly restarting the router to test code updates as this prevents network disruption.";
    t[7293] = "\u018fslin\u0259 qald\u0131qda, I2P \u015f\u0259b\u0259k\u0259 ba\u011flant\u0131s\u0131 olmadan i\u015fl\u0259yir. Bu, \u015f\u0259b\u0259k\u0259nin pozulmas\u0131n\u0131n qar\u015f\u0131s\u0131n\u0131 ald\u0131\u011f\u0131 \u00fc\u00e7\u00fcn routeri kod yenil\u0259m\u0259l\u0259rini yoxlamaq \u00fc\u00e7\u00fcn daim yenid\u0259n ba\u015flatsan\u0131z, faydal\u0131d\u0131r.";
    t[7302] = "Updating IP address";
    t[7303] = "IP \u00fcnvan\u0131 yenil\u0259nir";
    t[7308] = "SSU [IPv6 Only] with Introducers";
    t[7309] = "IPv6 Yaln\u0131z SSU, t\u0259qdim ed\u0259nl\u0259r";
    t[7312] = "SSU (Secure Semi-reliable UDP) is an I2P network transport providing encrypted, connection-oriented, point-to-point connections, in addition to IP address detection and NAT traversal services. For more information, see the <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7313] = "SSU (T\u0259hl\u00fck\u0259siz Yar\u0131-m\u0259nfi UDP) \u015eifr\u0259l\u0259nmi\u015f, i\u015ftirak ed\u0259n, n\u00f6qt\u0259-n\u00f6qt\u0259 ba\u011flant\u0131lar\u0131 t\u0259min ed\u0259n bir I2P \u015f\u0259b\u0259k\u0259 n\u0259qliyyat\u0131d\u0131r. Ek olaraq, IP \u00fcnvan\u0131 a\u015fkarlamas\u0131 v\u0259 NAT ke\u00e7isi xidm\u0259tl\u0259ri d\u0259 t\u0259min olunur. \u018flav\u0259 m\u0259lumat \u00fc\u00e7\u00fcn <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>\u0259lav\u0259 m\u0259lumat</a>-a bax\u0131n.";
    t[7314] = "Congestion window";
    t[7315] = "T\u0131xac p\u0259nc\u0259r\u0259si";
    t[7326] = "Use Proxy to Reseed";
    t[7327] = "Reseed \u00fc\u00e7\u00fcn Proksid\u0259n istifad\u0259 edin";
    t[7328] = "Until the advent of I2P integration in <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>, it wasn't possible to download torrents that weren't hosted on the I2P network. However, now that Vuze (and latterly <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) allow users to share non-I2P torrents on I2P, non-I2P torrents can be downloaded over I2P if Vuze/Bigly users have chosen to make content available to the I2P network. Popular torrents with a large number of peers are more likely to be accessible via I2P; to determine if the content is available, add the torrent link, magnet or infohash to your I2P-enabled BitTorrent client.";
    t[7329] = "\u01302P \u015f\u0259b\u0259k\u0259sind\u0259 qonaqli olmayan torrentl\u0259ri y\u00fckl\u0259m\u0259k m\u00fcmk\u00fcn deyildi, <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>-d\u0259 I2P-inteqrasiyas\u0131ndan \u0259vv\u0259l. Bununla yana\u015f\u0131, Vuze (v\u0259 sonralar <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) art\u0131q istifad\u0259\u00e7il\u0259r\u0259 qonaqs\u0131z onlar aras\u0131nda payla\u015fmaq etm\u0259y\u0259 imkan verir I2P \u00fcz\u0259rind\u0259. Bu halda, Vuze/Bigly istifad\u0259\u00e7il\u0259ri ya I2P \u015f\u0259b\u0259k\u0259sin\u0259 m\u00fcnasib\u0259t bildirm\u0259kl\u0259 olur. \u00e7\u0131xar\u0131\u015f n\u00f6qt\u0259si. M\u0259\u015fhur torrentl\u0259r\u0259 b\u00f6y\u00fck bir t\u0259r\u0259fda\u015f say\u0131na malik oldu\u011fundan, onlar I2P vasit\u0259sil\u0259 bax\u0131labilir; \u0259g\u0259r m\u0259zmunun m\u00f6vcudlu\u011funu m\u00fc\u0259yy\u0259nl\u0259\u015fdirm\u0259k ist\u0259yirsinizs\u0259, \u01302P-e icaz\u0259 veril\u0259r\u0259k torrent linkini, m\u0131knat\u0131s v\u0259 ya infohash-\u0131 \u0259lav\u0259 edin.";
