    t[7690] = "A distributed database containing router contact information (RouterInfos) and destination contact information (LeaseSets). A single router maintains its own (partial) database for communicating with other routers on the network; no single router will maintain a list of all routers. The RouterInfos are stored on disk and read into memory when the router starts, or when new RouterInfos are acquired. Also referred to as the <i>NetDb</i>. For more information, see the <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7691] = "Ruter \u0259laq\u0259 m\u0259lumatlar\u0131 (RuterInfos) v\u0259 h\u0259d\u0259f \u0259laq\u0259 m\u0259lumatlar\u0131 (LeaseSets) i\u00e7\u0259r\u0259n yay\u0131lan veril\u0259nl\u0259r bazas\u0131. T\u0259pm\u0259kar bir ruter \u015f\u0259b\u0259k\u0259y\u0259 aid dig\u0259r ruterd\u0259ki ruterl\u0259rl\u0259 \u0259laq\u0259 qurmaq \u00fc\u00e7\u00fcn \u00f6z (z\u0259r\u0259rli) veril\u0259nl\u0259r bazas\u0131n\u0131 (hiss\u0259sini) saxlay\u0131r; bu veril\u0259nl\u0259r bazas\u0131nda b\u00fct\u00fcn ruterl\u0259rin siyah\u0131s\u0131 saxlan\u0131lm\u0131r. RuterInfos disk\u0259 yaz\u0131l\u0131r v\u0259 ruter i\u015f\u0259 d\u00fc\u015fd\u00fcy\u00fcnd\u0259 v\u0259 ya yeni RuterInfos \u0259ld\u0259 edildikd\u0259 yadda\u015fa oxunur. H\u0259m\u00e7inin <i>NetDb</i> ad\u0131 il\u0259 d\u0259 tan\u0131n\u0131r. \u018ftrafl\u0131 m\u0259lumat \u00fc\u00e7\u00fcn, <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>onlayn s\u0259n\u0259dl\u0259r\u0259</a> bax\u0131n.";
    t[7692] = "Address";
    t[7693] = "\u00dcnvan";
    t[7694] = "A threshold is defined by the number of connection attempts a remote destination is permitted to perform over a specified number of seconds before a \"breach\" occurs.";
    t[7695] = "E\u015fik n\u00f6qt\u0259si m\u00fc\u0259yy\u0259nl\u0259nmi\u015f saniy\u0259 say\u0131 \u0259rzind\u0259 uzaq bir h\u0259d\u0259f t\u0259r\u0259find\u0259n ba\u015flat\u0131lan ba\u011flant\u0131 c\u0259hdl\u0259rinin say\u0131 t\u0259r\u0259find\u0259n m\u00fc\u0259yy\u0259nl\u0259\u015fdirilir ki, bir \"q\u0131r\u0131lma\" ba\u015f verm\u0259d\u0259n \u0259vv\u0259l n\u0259 q\u0259d\u0259r edil\u0259 bil\u0259r.";
    t[7704] = "Clearnet normally refers to the publicly accessible internet, the opposite of the darknet that typically describes the encrypted, anonymous services built on I2P, Tor etc. For more information, see the <a href=https://en.wikipedia.org/wiki/Clearnet_(networking) class='sitelink external' target=_blank rel=noreferrer>Wikipedia article</a>.";
    t[7705] = "Clearnet normal olaraq \u0259sas\u0259n \u0259m\u0259liyyat\u00e7\u0131 internet\u0259 i\u015far\u0131 edir v\u0259 bu, tipik olaraq I2P, Tor, v\u0259 s. \u00fcz\u0259rind\u0259 qurulmu\u015f \u015fifr\u0259l\u0259nmi\u015f, anonim xidm\u0259tl\u0259ri t\u0259snif ed\u0259n darknetin ziddidir. \u018ftrafl\u0131 m\u0259lumat \u00fc\u00e7\u00fcn, <a href=https://en.wikipedia.org/wiki/Clearnet_(networking) class='sitelink external' target=_blank rel=noreferrer>Wikipedia m\u0259qal\u0259sin\u0259</a> bax\u0131n.";
