    t[8208] = "Wherever possible, assets that are used repeatedly on your site should be loaded from an external file and not inlined. If you're using the same CSS on several pages, create a separate css file and load that in the <code>&lt;head&gt;</code> section of your pages. This will make styling updates to your site easier to manage, and will also allow the file to be cached in the visitor's browser, resulting in less bandwidth demands on your webserver and faster page loads for your visitors.";
    t[8209] = "Sayt\u0131n\u0131zda t\u0259krarlanan \u015f\u0259b\u0259k\u0259 hiss\u0259l\u0259ri varsa, m\u00fcmk\u00fcns\u0259, onlar\u0131 bir xarici fayldan y\u00fckl\u0259m\u0259k v\u0259 s\u0131radan yaratmaq daha yax\u015f\u0131d\u0131r. Bir ne\u00e7\u0259 s\u0259hif\u0259d\u0259 eyni CSS istifad\u0259 edirsinizs\u0259, m\u00fcst\u0259qil bir css fayl\u0131 yarad\u0131n v\u0259 onu s\u0259hif\u0259l\u0259rinizin <code>&lt;head&gt;</code> hiss\u0259sind\u0259 y\u00fckl\u0259yin. Bu, sayt\u0131n\u0131z\u0131n \u00fcslubunu idar\u0259 etm\u0259k \u00fc\u00e7\u00fcn daha asan yenil\u0259m\u0259l\u0259r ed\u0259c\u0259k v\u0259 h\u0259m\u00e7inin fayl\u0131n t\u0259r\u0259fda\u015f\u0131n brauzerind\u0259 ke\u00e7ilm\u0259sin\u0259 imkan ver\u0259c\u0259kdir, bu da veb serverinizin bant geni\u015fliyind\u0259n daha az istifad\u0259 etm\u0259yiniz\u0259 v\u0259 ziyar\u0259t\u00e7il\u0259riniz\u0259 daha s\u00fcr\u0259tli s\u0259hif\u0259 y\u00fckl\u0259nm\u0259sin\u0259 s\u0259b\u0259b ola bil\u0259r.";
