    t[8286] = "You have configured inbound TCP, however your UDP port is firewalled, and therefore it is likely that your TCP port is firewalled as well.";
    t[8287] = "Siz daxil olan TCP-ni konfiqurasiya etmisiniz, lakin UDP portunuz t\u0259hl\u00fck\u0259sizlik divar\u0131 il\u0259 qorunub v\u0259 buna g\u00f6r\u0259 d\u0259 \u00e7ox g\u00fcman ki, sizin TCP portunuz da t\u0259hl\u00fck\u0259sizlik divar\u0131na malikdir.";
    t[8296] = "This is the number of peers your router will use for network database inquiries. These are usually the <i>floodfill</i> routers which are responsible for maintaining network integrity. Your well integrated peers are shown on the bottom of the <a href='/profiles'>Profiles page</a>.";
    t[8297] = "Bu, y\u00f6nlendiricinizin a\u011f veritaban\u0131 sorgular\u0131 i\u00e7in kullanaca\u011f\u0131 akranlar\u0131n say\u0131s\u0131d\u0131r. Bunlar genellikle a\u011f b\u00fct\u00fcnl\u00fc\u011f\u00fcn\u00fc sa\u011flamakla g\u00f6revli olan <i>floodfill</i> y\u00f6nlendiricileridir. \u0130yi entegre edilmi\u015f akranlar\u0131n\u0131z <a href='/profiles'>Profiller sayfas\u0131nda</a> alt k\u0131s\u0131mda g\u00f6sterilir.";
    t[8298] = "Manage Router webapps";
    t[8299] = "Routerin veb proqramlar\u0131n\u0131 idar\u0259 edin";
    t[8302] = "Outbound TCP from random high ports to arbitrary remote TCP ports.";
    t[8303] = "T\u0259sad\u00fcfi y\u00fcks\u0259k portlardan t\u0259sad\u00fcfi uzaq TCP portlar\u0131na \u00e7\u0131x\u0131\u015f.";
    t[8310] = "When you start I2P, it may take a few minutes to bootstrap (integrate) your router into the network and find additional peers, so please be patient.";
    t[8311] = "I2P-ni i\u015f\u0259 sald\u0131qda, mar\u015frutla\u015fd\u0131r\u0131c\u0131n\u0131z\u0131 \u015f\u0259b\u0259k\u0259y\u0259 y\u00fckl\u0259m\u0259k (inteqrasiya etm\u0259k) v\u0259 \u0259lav\u0259 h\u0259mya\u015f\u0131dlar tapmaq bir ne\u00e7\u0259 d\u0259qiq\u0259 \u00e7\u0259k\u0259 bil\u0259r, buna g\u00f6r\u0259 d\u0259 s\u0259birli olun.";
    t[8318] = "No file specified. Please select a valid .zip or .su3 file to reseed from.";
    t[8319] = "He\u00e7 bir fayl g\u00f6st\u0259rilm\u0259yib. ";
