    t[8327] = "IPv6 Yaln\u0131z NTCP, SSU, t\u0259qdim ed\u0259nl\u0259r";
    t[8332] = "Messages sent to peer";
    t[8333] = "H\u0259mya\u015f\u0131dlara g\u00f6nd\u0259ril\u0259n mesajlar";
    t[8334] = "Function";
    t[8335] = "Funksiya";
    t[8336] = "On the I2P network, remotely hosted services can be accessed using a <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> address ending in \".b32.i2p\", a <i>destination</i> represented as a long <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a> string, or more usually by using an .i2p domain. A destination is I2P's equivalent to an IP address, and is shown on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. You can share your b32.i2p address to allow others to access to your website until you've registered your own .i2p domain.";
    t[8337] = "I2P \u015f\u0259b\u0259k\u0259sind\u0259, uzaqda yerl\u0259\u015f\u0259n xidm\u0259tl\u0259r\u0259 <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> biti\u015fiklikl\u0259 bit\u0259n \".b32.i2p\" \u00fcnvan\u0131, uzun <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a> s\u0131ra \u015f\u0259klind\u0259 t\u0259msil olunan bir <i>destinasiya</i> v\u0259 ya daha \u00e7ox  .i2p domeni istifad\u0259 edil\u0259r\u0259k giri\u015f edil\u0259 bil\u0259r. Bir destinasiya I2P-nin bir IP \u00fcnvan\u0131na b\u0259nz\u0259yir v\u0259 <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Meneceri t\u0259nziml\u0259m\u0259 s\u0259hif\u0259sind\u0259</a> g\u00f6r\u00fcn\u00fcr. Qeydiyyats\u0131z .i2p domaininizin olana q\u0259d\u0259r b32.i2p \u00fcnvan\u0131n\u0131z\u0131 ba\u015fqalar\u0131n\u0131n veb sayt\u0131n\u0131za giri\u015f etm\u0259sin\u0259 icaz\u0259 ver\u0259 bil\u0259rsiniz.";
    t[8340] = "Computing-related tutorials";
