    t[8350] = "Enter the name and paste the destination into your <a href='/dns?book=router&amp;filter=none'>address book</a>. Click <i>Add</i> to save the new entry.";
    t[8351] = "Ad\u0131 daxil edin v\u0259 \u00e7at\u0131\u015fmaq yerini <a href='/dns?book=router&amp;filter=none'>\u00fcnvan kitab\u00e7as\u0131na</a> yap\u0131\u015fd\u0131r\u0131n. Yeni qeydiyyat\u0131 saxlamaq \u00fc\u00e7\u00fcn <i>\u018flav\u0259 et</i> d\u00fcym\u0259sini bas\u0131n.";
