    t[8409] = "Sybil bloklanma siyah\u0131s\u0131n\u0131 sil";
    t[8410] = "To disable directory listings, find the entry for <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> in the <code>base-context.xml</code> file, located in the <code>eepsite/contexts</code> folder (just above docroot folder), and change 'true' to 'false' immediately underneath. To apply the change immediately, stop and restart the <i>I2P Webserver</i> client on the <a href=/configclients>Client Configuration page</a>. You can also drop an empty <code>index.html</code> file in any exposed directory to suppress directory listings for that location.";
    t[8411] = "Qovluq siyah\u0131lar\u0131n\u0131 s\u00f6nd\u00fcrm\u0259k \u00fc\u00e7\u00fcn, <code>base-context.xml</code> fayl\u0131nda <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> qeydin tap\u0131n. Fayl <code>eepsite/contexts</code> qovlu\u011funda yerl\u0259\u015fir (sol t\u0259r\u0259fd\u0259 olan folder docroot folder-d\u0259n yuxar\u0131da olmal\u0131d\u0131r). 'true' yerin\u0259 d\u0259rhal alt\u0131ndak\u0131 yer\u0259 'false' yaz\u0131n. D\u0259yi\u015fikliyi d\u0259rhal t\u0259tbiq etm\u0259k \u00fc\u00e7\u00fcn, <i>I2P Webserver</i> m\u00fc\u015ft\u0259risini <a href=/configclients>M\u00fc\u015ft\u0259ri Konfiqurasiya s\u0259hif\u0259sind\u0259</a> dayand\u0131r\u0131b yenid\u0259n ba\u015flad\u0131n. H\u0259m\u00e7inin, istifad\u0259 olunan h\u0259r hans\u0131 bir qovlu\u011fa bo\u015f bir <code>index.html</code> fayl\u0131 \u0259lav\u0259 ed\u0259r\u0259k, h\u0259min konumdak\u0131 qovluq siyah\u0131lar\u0131n\u0131 l\u0259\u011fv ed\u0259 bil\u0259rsiniz.";
