    t[8466] = "Can be disabled in the <code>clients.config</code> file. Can also be configured to bind to a specific interface or all interfaces. If you make the Router Console available over the network, you might wish to <a href=/configui#passwordheading>enforce an access password</a> to prevent unauthorized access.";
    t[8467] = "Faylda <code>clients.config</code> qaba\u011f\u0131n\u0131 da yand\u0131ra bil\u0259rsiniz. Ayr\u0131ca \u00fcmumi v\u0259 ya m\u00fc\u0259yy\u0259n etm\u0259k \u00fc\u00e7\u00fcn m\u00fc\u0259yy\u0259n bir interface-a onlar s\u00fcrm\u0259k d\u0259 m\u00fcmk\u00fcnd\u00fcr. Router Konsolu \u015f\u0259b\u0259k\u0259 \u00fcz\u0259rind\u0259 m\u00f6vcud edildikd\u0259, qeyri-qanuni daxil edilmi\u015f embaza qar\u015f\u0131 <a href=/configui#passwordheading>giri\u015f parolu</a> t\u0259tbiq ed\u0259 bil\u0259rsiniz.";
