    t[8554] = "If you're not using IE, it's likely that your browser is pretending to be IE; please configure your browser (or proxy) to use a different User Agent string if you'd like to access the console themes.";
    t[8555] = "Y\u0259ni istifad\u0259 etmirsinizs\u0259, brauzerinizin IE kimi iddia etdiyi ehtimal olunur; Z\u0259hm\u0259t olmasa, konsol m\u00f6vzular\u0131na daxil olmaq ist\u0259s\u0259niz, f\u0259rqli bir istifad\u0259\u00e7i agenti simli istifad\u0259 etm\u0259k \u00fc\u00e7\u00fcn brauzerinizi (v\u0259 ya proxy) -dan konfiqurasiya edin.";
    t[8564] = "Privacy-focused Clearnet Search Engine";
    t[8565] = "M\u0259xfiliy\u0259 y\u00f6n\u0259lmi\u015f Clearnet Axtar\u0131\u015f M\u00fch\u0259rriki";
    t[8572] = "<a href=/logs>Logs</a> may help resolve a problem. You may wish to paste excerpts in a <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>forum</a> for help, or perhaps <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>paste</a> it instead and reference the link on IRC for help.";
    t[8573] = "<a href=/logs>Qeydl\u0259r</a> problemi h\u0259ll etm\u0259y\u0259 k\u00f6m\u0259k ed\u0259 bil\u0259rsiniz. Kopyalar\u0131 <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>foruma</a> yap\u0131\u015fd\u0131ra bil\u0259rsiniz, yada \u0259v\u0259zind\u0259 <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>yap\u0131\u015fd\u0131rarak</a> sonra IRC-d\u0259 d\u0259st\u0259k linki il\u0259 istifad\u0259 ed\u0259 bil\u0259rsiniz.";
    t[8574] = "Plugins signed with the cryptographic key of the developer are the recommended format, but if you wish to install unsigned plugins (.zip) you can set this to true. Note that you may still encounter issues attempting to install an unsigned plugin if the developer has included additional checks in the plugin build process.";
    t[8575] = "T\u0259rtibat\u00e7\u0131n\u0131n kriptoqrafik a\u00e7ar\u0131 il\u0259 imzalanm\u0131\u015f qo\u015fmalar t\u00f6vsiy\u0259 olunan formatd\u0131r, lakin i\u015far\u0259siz qo\u015fmalar\u0131 (.zip) qura\u015fd\u0131rmaq ist\u0259yirsinizs\u0259, bunu do\u011fru \u015f\u0259kild\u0259 qura bil\u0259rsiniz. N\u0259z\u0259r\u0259 al\u0131n ki, t\u0259rtibat\u00e7\u0131 plaginin qurulmas\u0131 prosesin\u0259 \u0259lav\u0259 yoxlamalar daxil edibs\u0259, h\u0259l\u0259 d\u0259 i\u015far\u0259siz plugin qura\u015fd\u0131rma\u011fa c\u0259hd ed\u0259rk\u0259n probleml\u0259rl\u0259 qar\u015f\u0131la\u015fa bil\u0259rsiniz.";
    t[8578] = "If you are running a standalone Tor instance locally, you may use it by configuring I2P to use: <i>Proxy type:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9050</code>.";
    t[8579] = "Yerli olaraq m\u00fcst\u0259qil Tor n\u00fcmun\u0259si i\u015fl\u0259dirsinizs\u0259, I2P-ni a\u015fa\u011f\u0131dak\u0131lardan istifad\u0259 etm\u0259k \u00fc\u00e7\u00fcn konfiqurasiya etm\u0259kl\u0259 istifad\u0259 ed\u0259 bil\u0259rsiniz: <i>Proksi n\u00f6v\u00fc:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9050</code>.";
    t[8584] = "Select the language to be used for the router console and web applications (<a href=/webmail target=_blank rel=noreferrer>webmail</a>, <a href=/torrents target=_blank rel=noreferrer>torrents</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>tunnel manager</a> etc). If you wish to change the language in future, change the router console theme, or configure a password to access the console, you may do so on the <a href=/configui target=_blank rel=noreferrer>User Interface configuration page</a>.";
    t[8585] = "Router konsolu v\u0259 veb t\u0259tbiqetm\u0259l\u0259ri \u00fc\u00e7\u00fcn istifad\u0259 edil\u0259c\u0259k dil se\u00e7in (<a href=/webmail hight=noreferrer>webmail</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>Tunel Meneceri</a> v\u0259 s.). G\u0259l\u0259c\u0259kd\u0259 dili d\u0259yi\u015fdirm\u0259k ist\u0259s\u0259niz, mar\u015frutla\u015fd\u0131r\u0131c\u0131 konsol m\u00f6vzusunu d\u0259yi\u015fdirin v\u0259 ya konsolun daxil olmas\u0131 \u00fc\u00e7\u00fcn bir \u015fifr\u0259ni konfiqurasiya edin, bunu ed\u0259 bil\u0259rsiniz <a href=configui target=_blank rel=noreferrer> \u0130stifad\u0259\u00e7i interfeysi konfiqurasiya s\u0259hif\u0259sind\u0259 ed\u0259 bil\u0259rsiniz.</a>.";
