    t[9240] = "A simple CGI application that takes a hostname as a parameter and returns a 301 redirect to the proper URL with a <code>?i2paddresshelper=key</code> string appended. The HTTP proxy will interpret the appended string and use the key as the actual destination. In addition, the proxy will cache the key so the address helper is not necessary until restart, and offer the option to add the resolved address to the addressbook.";
    t[9241] = "A simple CGI t\u0259tbiqdir ki, t\u0259k\u0259r bir host ad\u0131n\u0131 parametr kimi g\u00f6t\u00fcr\u00fcr v\u0259 <code>?i2paddresshelper=key</code> \u0259lav\u0259 edilmi\u015f do\u011fru URL \u00fc\u00e7\u00fcn bir 301 y\u00f6nl\u0259ndirm\u0259sin\u0259 qaytar\u0131r. HTTP proksisi \u0259lav\u0259 olunmu\u015f s\u0259tiri i\u015fl\u0259y\u0259c\u0259k v\u0259 m\u0259qs\u0259d\u0259 uy\u011fun olaraq istifad\u0259 ed\u0259c\u0259k. Bundan \u0259lav\u0259, proksi a\u00e7\u0131qlanan \u00fcnvan\u0131 kitab\u00e7ana \u0259lav\u0259 etm\u0259k imkan\u0131n\u0131 t\u0259klif ed\u0259c\u0259kdir.";
