    t[9292] = "This setting (in minutes) allows you to manually configure how long to wait after startup before RouterInfos in the NetDb are checked for validity, after which point only valid routers will be accepted for inclusion. When the validation occurs, expired RouterInfos and unresponsive peers only accessible via SSU will be removed from the NetDb. [Default is 60 minutes] Note: This setting has no bearing on older routers (older than 0.9.29 by default) which are removed from the NetDb and banned for the router session as soon as a NetDb store is attempted.";
    t[9293] = "Bu ayar (d\u0259qiq\u0259l\u0259rl\u0259) sizin ist\u0259yiniz\u0259 \u0259sas\u0259n y\u00f6nl\u0259ndirici m\u0259lumatlar\u0131n\u0131n \u0130nformasiya \u0130qliminin vaxt\u0131ndan sonra ne\u00e7\u0259 d\u0259qiq\u0259 g\u00f6zl\u0259nilm\u0259si haqq\u0131nda \u0259lav\u0259 t\u0259nziml\u0259m\u0259 imkan\u0131 verir. Bu vaxtdan sonra, yaln\u0131z d\u00fczg\u00fcn y\u00f6nl\u0259ndiricil\u0259r q\u0259bul edil\u0259c\u0259kdir. Bu do\u011frulama zaman\u0131, sona \u00e7atm\u0131\u015f y\u00f6nl\u0259ndirici m\u0259lumatlar\u0131 v\u0259 SSU vasit\u0259sil\u0259 yaln\u0131z laz\u0131ms\u0131z m\u00fc\u015fahid\u0259\u00e7il\u0259r qeyb olurlar, \u0130nformasiya \u0130qlimind\u0259n \u00e7\u0131xar\u0131lacaq. [Default olaraq 60 d\u0259qiq\u0259] Qeyd edin: Bu ayar, \u0130nformasiya \u0130qlimimd\u0259n \u00e7\u0131xar\u0131laraq doru\u015f t\u0259r\u0259fd\u0259n qovulan k\u00f6hn\u0259 y\u00f6nl\u0259ndiricil\u0259rin (default olaraq 0.9.29-dan k\u00f6hn\u0259l\u0259ri) \u0130nformasiya \u0130qlimid\u0259n k\u0259narla\u015fd\u0131rmaq v\u0259 qada\u011fan etm\u0259k \u00fc\u00e7\u00fcn n\u0259zar\u0259t\u0259 \u00e7\u0259kmir.";
