    t[9326] = "The router's external port allows communication with other routers. It is recommended to configure your firewall to allow inbound and outbound traffic on this port to optimize your router's performance on the network.";
    t[9327] = "Routerin xarici liman\u0131 dig\u0259r mar\u015frutla\u015fd\u0131r\u0131c\u0131larla \u00fcnsiyy\u0259t\u0259 imkan verir. Bu portda yolun \u015f\u0259b\u0259k\u0259d\u0259ki performans\u0131n\u0131 optimalla\u015fd\u0131rmaq \u00fc\u00e7\u00fcn bu portda giri\u015f v\u0259 xarici trafik\u0259 icaz\u0259 verm\u0259k \u00fc\u00e7\u00fcn firewall\u0131n\u0131z\u0131 konfiqurasiya etm\u0259k t\u00f6vsiy\u0259 olunur.";
    t[9328] = "Bulk Thresholds";
