    t[9351] = "Yax\u015f\u0131 Axtar\u0131\u015flar";
    t[9354] = "Reseeding is the bootstrapping process used to find other routers when you first install I2P, or when your router has too few router references remaining. The default settings will work for most people. Change these only if HTTPS is blocked by a restrictive firewall and reseed has failed.";
    t[9355] = "\u018fvv\u0259lc\u0259d\u0259n I2P qura\u015fd\u0131rd\u0131\u011f\u0131n\u0131zda v\u0259 ya sizin r\u00f6terinizd\u0259 \u00e7ox az r\u00f6ter istinad\u0131 qald\u0131\u011f\u0131 zaman dig\u0259r r\u00f6terl\u0259ri tapmaq \u00fc\u00e7\u00fcn istifad\u0259 olunan b\u00f6t\u00f6v prosessidir. Standart parametrl\u0259r \u00e7ox insan \u00fc\u00e7\u00fcn \u00e7al\u0131\u015f\u0131r. Yaln\u0131z HTTPS \u0259ng\u0259ll\u0259yici bir firewall t\u0259r\u0259find\u0259n bloklanan v\u0259 b\u00f6t\u00f6vl\u0259nm\u0259 ba\u015f tutmu\u015fsa yaln\u0131z onda bu d\u0259yi\u015fiklikl\u0259ri edin.";
    t[9362] = "This setting, when enabled, modifies the maximum additional random pong delay introduced for ping-enabled servers, if <code>i2p.streaming.enablePongDelay</code> is also enabled. Unless explicitly set, the default value of 50ms will be used.";
    t[9363] = "Bu parametr aktiv edildikd\u0259, i2p.streaming.enablePongDelay d\u0259 aktivdirs\u0259, ping effektiv serverl\u0259r \u00fc\u00e7\u00fcn t\u0259qdim edil\u0259n maksimum \u0259lav\u0259 <code></code> t\u0259sad\u00fcfi pong gecikm\u0259sini d\u0259yi\u015fdirir. A\u00e7\u0131q \u015f\u0259kild\u0259 t\u0259yin edilm\u0259diyi t\u0259qdird\u0259, 50 milyon standart d\u0259y\u0259rd\u0259n istifad\u0259 edil\u0259c\u0259k.";
