    t[9474] = "Your I2P+ router by default contributes to the network by routing internal, end-to-end encrypted traffic for other routers, known as <i>participation</i>. Bandwidth participation improves the anonymity level of all users on the network and maximizes your download speed.";
    t[9475] = "I2P+ t\u0131r\u0131nc\u0131n\u0131z, varsay\u0131lan olarak di\u011fer y\u00f6nlendiriciler i\u00e7in i\u00e7, u\u00e7tan uca \u015fifrelenmi\u015f trafi\u011fi y\u00f6nlendirerek a\u011fa katk\u0131da bulunur, buna <i>kat\u0131l\u0131m</i> denir. Bant geni\u015fli\u011fi kat\u0131l\u0131m\u0131, a\u011fdaki t\u00fcm kullan\u0131c\u0131lar\u0131n anonimlik seviyesini art\u0131r\u0131r ve indirme h\u0131z\u0131n\u0131z\u0131 maksimize eder.";
    t[9476] = "This setting permits the configuration of alternative NTP servers required to ensure that your router maintains accurate clock time. [Default is 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
    t[9477] = "Bu parametr ruterinizin d\u0259qiq saat vaxt\u0131n\u0131 qorudu\u011funa \u0259min olmaq \u00fc\u00e7\u00fcn t\u0259l\u0259b olunan alternativ NTP serverl\u0259rinin konfiqurasiyas\u0131na icaz\u0259 verir. [Standart 0.pool.ntp.org ,1.pool.ntp.org,2.pool.ntp.org]";
    t[9484] = "Optimize your images";
    t[9485] = "\u015e\u0259kill\u0259rinizi optimalla\u015fd\u0131r\u0131n";
    t[9488] = "Note that the profiler relies on sustained client tunnel usage to accurately profile peers.";
    t[9489] = "Qeyd ed\u0259k ki, profil t\u0259rtibat\u00e7\u0131s\u0131 h\u0259mya\u015f\u0131dlar\u0131n\u0131 d\u0259qiq profil etm\u0259k \u00fc\u00e7\u00fcn davaml\u0131 m\u00fc\u015ft\u0259ri tunelind\u0259n istifad\u0259 edir.";
    t[9492] = "If you are in a hurry and can't wait a few hours, you can tell people to use a \"jump\" address helper redirection service. This will usually work within a few minutes of your registering your hostname on the same site. Test it yourself first by entering <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>yourchosenhostname.i2p</i></code> into your browser. Once it is working, you can tell others to use it.";
    t[9493] = "\u018fg\u0259r \u00e7ox s\u00fcr\u0259tliysinizs\u0259 v\u0259 bir ne\u00e7\u0259 saat g\u00f6zl\u0259m\u0259k ist\u0259mirs\u0259niz, insanlara \"jump\" \u00fcnvan k\u00f6m\u0259k\u00e7i yenid\u0259n y\u00f6nl\u0259ndirilm\u0259 xidm\u0259tind\u0259n istifad\u0259 etm\u0259l\u0259rini dey\u0259 bil\u0259rsiniz. Bu, host ad\u0131n\u0131z\u0131 eyni saytda qeydiyyata alman\u0131zdan bir ne\u00e7\u0259 d\u0259qiq\u0259 sonra ad\u0259t\u0259n i\u015fl\u0259y\u0259c\u0259kdir. \u00d6nc\u0259 onu b\u0259y\u0259nin\u0259 daxil ed\u0259r\u0259k \u00f6z\u00fcn\u00fcz\u0259 bax\u0131n. <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>yourchosenhostname.i2p</i></code>. \u0130\u015fl\u0259y\u0259nd\u0259, ba\u015fqalar\u0131na da istifad\u0259 etm\u0259l\u0259rini dey\u0259 bil\u0259rsiniz.";
