    t[10038] = "To configure an alternative webserver for use on I2P, you can either use the existing webserver tunnel and <a href=/configclients>disable the default webserver</a> from running, or create a new HTTP Server tunnel in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Ensure that the webserver's <i>listening port</i> is also configured in the Tunnel Manager settings. For example, if your webserver is listening by default on address 127.0.0.1 port 80, you'd also need to ensure that the <i>Target port</i> in the Tunnel Manager settings page for the service is also configured to port 80.";
    t[10039] = "I2P-d\u0259 alternativ bir veb-serveri konfiqurasiya etm\u0259k \u00fc\u00e7\u00fcn, m\u00f6vcud veb-serverin t\u00fcnell\u0259rind\u0259n istifad\u0259 ed\u0259 v\u0259 ya yeni bir HTTP Server t\u00fcn\u0259lini <a href=/configclients>buca\u011f\u0131ndan qald\u0131ra bil\u0259rsiniz. gedi\u015fat almana\u011f\u0131n\u0131n i\u015fl\u0259nm\u0259sini deaktivl\u0259\u015fdirm\u0259k \u00fc\u00e7\u00fcn, yaxud <a href=/i2ptunnelmgr>T\u00fcnell\u0259r meneceri</a>-d\u0259 yeni bir HTTP Server t\u00fcr\u0259si yarad\u0131la bil\u0259r. Veb serverin <i> dinl\u0259nm\u0259 ha\u00e7\u0131</i> ayr\u0131ca T\u00fcnell\u0259r Meneceri ayarlar\u0131nda konfiqurasiya edilsin. M\u0259s\u0259l\u0259n, ehtimal ed\u0259k ki, veb serveriniz 127.0.0.1 \u00fcnvan\u0131nda 80 portunda dinl\u0259nir, o zaman xidm\u0259t \u00fc\u00e7\u00fcn T\u00fcnell\u0259r Menecerind\u0259ki <i>H\u0259d\u0259f port</i>nun konfiqurasiya edildiyin\u0259 d\u0259 \u0259min olmal\u0131s\u0131n\u0131z oldiqda port 80 d\u0259dir.";
    t[10040] = "Torrents";
