    t[10045] = "IRC proxy";
    t[10046] = "An I2P router usually only needs to be seeded once, to join the network for the first time. However, if the router is running for an extended period without network connectivity it may also need to be reseeded. Reseeding involves fetching multiple \"RouterInfo\" files (bundled into a signed zip-file) from at least two predefined server URLs picked from a volunteer-run group of clearnet HTTPS servers.";
    t[10047] = "Bir i2P router ad\u0259t\u0259n yaln\u0131z bir d\u0259f\u0259 yaln\u0131z bir d\u0259f\u0259 toxunun, ilk d\u0259f\u0259 \u015f\u0259b\u0259k\u0259y\u0259 qo\u015fulmaq laz\u0131md\u0131r. Bununla birlikd\u0259, mar\u015frutla\u015fd\u0131r\u0131c\u0131 \u015f\u0259b\u0259k\u0259 ba\u011flant\u0131s\u0131 olmadan uzun m\u00fcdd\u0259t davam ed\u0259rs\u0259, onu da b\u0259rpa etm\u0259k laz\u0131md\u0131r. Repeeding, \u00e7ox sayda \u0259vv\u0259lc\u0259d\u0259n t\u0259yin edilmi\u015f server URL-l\u0259rd\u0259n bir \u00e7ox \"routerinfo\" fayllar\u0131n\u0131 (imzalanm\u0131\u015f bir zip-fayl\u0131na), \u0259n az\u0131 iki \u0259vv\u0259lc\u0259d\u0259n t\u0259yin edilmi\u015f server URL-l\u0259rd\u0259n, ClearNet-in CleanNet ClemaNET serverl\u0259rind\u0259n se\u00e7ilmi\u015f \u0259n az\u0131 iki \u0259vv\u0259lc\u0259d\u0259n t\u0259yin edilmi\u015f server URL-l\u0259rd\u0259n g\u00f6t\u00fcrm\u0259yi \u0259hat\u0259 edir.";
