    t[10318] = "Where possible, please ensure I2P+/Java is allowed bi-directional port access from the internet by configuring your modem/router/pc firewall accordingly. If you're behind a prohibitive firewall but have unrestricted outbound access, I2P+ can still function; you can turn off inbound access and rely on <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>SSU IP Address Detection</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>firewall hole punching</a>) to connect you to the network, and your network status in the side panel will indicate \"Status: Firewalled\". For optimal performance, please ensure I2P's <a href=/confignet#udpconfig>external port</a> is visible from the internet (see below for more information).";
    t[10319] = "Jahada m\u00fcmk\u00fcn olan yerl\u0259rd\u0259, I2P+/Java proqram\u0131na \u0130nternetd\u0259n h\u0259r iki t\u0259r\u0259fli porta \u00e7\u0131xma icaz\u0259si verm\u0259k \u00fc\u00e7\u00fcn modem / y\u00f6nl\u0259ndirici / PC s\u00fcng\u0259rinizi uy\u011fun \u015f\u0259kild\u0259 konfiqurasiya etm\u0259y\u0259 \u0259min olun. \u018fg\u0259r m\u0259hdudla\u015fd\u0131r\u0131lm\u0131\u015f bir s\u00fcng\u0259r ard\u0131c\u0131l\u0131ndas\u0131n\u0131zsa, lakin s\u0259rb\u0259st \u00e7\u0131x\u0131\u015fa maliksinizs\u0259, I2P+ h\u0259l\u0259 d\u0259 i\u015fl\u0259y\u0259 bil\u0259r; g\u0259l\u0259n m\u00fcraci\u0259ti s\u00f6nd\u00fcr\u0259 bil\u0259rsiniz v\u0259 \u015f\u0259b\u0259k\u0259y\u0259 qo\u015fulmaq \u00fc\u00e7\u00fcn <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>SSU IP \u00dcnvan\u0131n\u0131 A\u015fkar Etme</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>s\u00fcng\u0259 yor\u011fan\u0131</a>) \u00fcz\u0259rind\u0259 se\u00e7im ed\u0259 bil\u0259rsiniz network, v\u0259 yan panelinizd\u0259ki \u015f\u0259b\u0259k\u0259 v\u0259ziyy\u0259ti \"Status: Firewalled\" g\u00f6st\u0259ril\u0259c\u0259k. \u018fn yax\u015f\u0131 performans \u00fc\u00e7\u00fcn, I2P'nin <a href=/confignet#udpconfig>\u015f\u0259b\u0259k\u0259niq aparac\u0131 portu</a> internetd\u0259n g\u00f6r\u00fcn\u0259 bil\u0259r olmal\u0131d\u0131r (daha \u00e7ox m\u0259lumat \u00fc\u00e7\u00fcn a\u015fa\u011f\u0131ya bax\u0131n).";
