    t[11024] = "By default, I2P will use the system configured default browser to launch at startup. If you wish to nominate an alternative browser, you will need to edit your router.config file (or the <a href=/configadvanced>Advanced Configuration page</a> if you have enabled advanced console mode) and add a new configuration line <code>routerconsole.browser=/path/to/browser</code> or <code>routerconsole.browser=\\path\\to\\browser.exe</code> if using Windows, replacing <code>\\path\\to\\browser</code> with the location of the browser you wish to use. Note: If the path to your chosen browser contains spaces, you may need to encase the path in quotes e.g. <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
    t[11025] = "Varsay\u0131lan olaraq, I2P sistemi konfiqurasiya edilmi\u015f veb brauzerini ba\u015flamaq \u00fc\u00e7\u00fcn istifad\u0259 edir. Ba\u015fqa bir brauzeri namiz\u0259d g\u00f6st\u0259rm\u0259k ist\u0259yirsinizs\u0259, router.config fayl\u0131n\u0131 (v\u0259 ya Advanced Console rejimini etkinl\u0259\u015fdirs\u0259niz <a href=/configadvanced>advanced Configuration page</a>) redakt\u0259 etm\u0259li v\u0259 yeni bir konfiqurasiya s\u0259tirin\u0259 <code>routerconsole.browser=/path/to/browser</code> \u0259lav\u0259 etm\u0259lisiniz v\u0259 ya Windows-dan istifad\u0259 edir\u0259ks\u0259niz <code>routerconsole.browser=\\path\\to\\browser.exe</code>, <code>\\path\\to\\browser</code> brauzer\u0259 istifad\u0259 etm\u0259k ist\u0259diyiniz yerl\u0259 \u0259v\u0259z edin. Qeyd: Se\u00e7diyiniz brauzerin yolunda bo\u015fluqlar varsa, olaca\u011f\u0131n\u0131 t\u0131rnaqlar i\u00e7\u0259risind\u0259 qoyman\u0131z laz\u0131m olar e.g. <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
