    t[11106] = "This setting (in hours) allows you to manually configure how old a RouterInfo is in order for it to be checked by the Refresh Routers Job. By default, the age of a RouterInfo before a refresh is intitiated scales according to the size of the NetDb, increasing as the NetDb grows in size. A value of 0 will force the Router Refresh Job to check every router in the NetDb, regardless of age.";
    t[11107] = "Bu parametr (saatlarla) Refresh Routers Job t\u0259r\u0259find\u0259n yoxlan\u0131lmas\u0131 \u00fc\u00e7\u00fcn RouterInfo-nun ne\u00e7\u0259 ya\u015f\u0131nda oldu\u011funu \u0259l il\u0259 konfiqurasiya etm\u0259y\u0259 imkan verir. Standart olaraq, yenil\u0259m\u0259d\u0259n \u0259vv\u0259l RouterInfo ya\u015f\u0131 NetDb \u00f6l\u00e7\u00fcs\u00fcn\u0259 uy\u011fun olaraq \u00f6l\u00e7\u00fcl\u00fcr, NetDb \u00f6l\u00e7\u00fcs\u00fcnd\u0259 getdikc\u0259 art\u0131r. 0 d\u0259y\u0259ri Router Yenil\u0259m\u0259 \u0130\u015fini ya\u015f\u0131ndan as\u0131l\u0131 olmayaraq NetDb-d\u0259ki h\u0259r bir routeri yoxlama\u011fa m\u0259cbur ed\u0259c\u0259k.";
