    t[11128] = "An I2P web application that manages service destinations for the network, mapping B64 hashes to human-readable names. Destinations may be added manually, or via subscriptions to hosts.txt files. Also referred to as SusiDNS. For more information, see the <a href=https://geti2p.net/en/docs/naming class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[11129] = "R\u0259q\u0259msal ay\u0131rma sisteml\u0259ri (B64) dagitma \u015f\u0259b\u0259k\u0259si \u00fc\u00e7\u00fcn xidm\u0259t destinasiyalar\u0131n\u0131 idar\u0259 ed\u0259n I2P web t\u0259tbiqidir. Destinasiyalar \u0259l il\u0259 \u0259lav\u0259 oluna bil\u0259r v\u0259 ya hosts.txt fayllar\u0131na abun\u0259 olaraq \u0259lav\u0259 oluna bil\u0259r. Habel\u0259, SusiDNS kimi d\u0259 adland\u0131r\u0131l\u0131r. \u018ftrafl\u0131 m\u0259lumat \u00fc\u00e7\u00fcn <a href=https://geti2p.net/en/docs/naming class='sitelink external' target=_blank rel=noreferrer>onlayn s\u0259n\u0259dl\u0259ndirm\u0259y\u0259</a> m\u00fcraci\u0259t edin.";
