    t[11150] = "A tunnel to the main IRC server network within I2P, Irc2P, is created when I2P is installed (see the <a href=/i2ptunnelmgr>Tunnel Manager</a>), and is automatically started when the I2P router starts. To connect to it, tell your IRC client to connect to server: <code>127.0.0.1</code> port: <code>6668</code>.";
    t[11151] = "I2P daxil edildikd\u0259, Irc2P kimi I2P-nin \u0259sas IRC server \u015f\u0259b\u0259k\u0259sin\u0259 bir tunel yarad\u0131l\u0131r (Bax /i2ptunnelmgr href =), v\u0259 bunun avtostart zaman\u0131 I2P router il\u0259 ba\u015flay\u0131r. Ona qo\u015fulmaq \u00fc\u00e7\u00fcn, IRC m\u00fc\u015ft\u0259riyiniz\u0259 server-f\u0259al\u0259t\u0259 dem\u0259k \u00fc\u00e7\u00fcn dem\u0259k laz\u0131md\u0131r: <code>127.0.0.1</ code> port: <code>6668</ code>.";
