    t[11230] = "Can be enabled in the <code>clients.config</code> file. Can also be configured to bind to a specific interface or all interfaces. If both http and https are enabled, automatic redirection to https is enabled by default. If you make the Router Console available over the network, you might wish to <a href=/configui#passwordheading>enforce an access password</a> to prevent unauthorized access.";
    t[11231] = "<code>clients.config</code> fayl\u0131nda aktivl\u0259\u015fdiril\u0259 bil\u0259r. H\u0259m\u00e7inin m\u00fc\u0259yy\u0259n bir interface v\u0259 ya b\u00fct\u00fcn interfacel\u0259r\u0259 ba\u011flamaq \u00fc\u00e7\u00fcn konfiqurasiyala\u015fd\u0131r\u0131la bil\u0259r. Http v\u0259 https h\u0259r ikisi aktivl\u0259\u015fdirilmi\u015fd\u0259dirs\u0259, avtomatik olaraq https-\u0259 y\u00f6nlendirilir. Router Konsolu \u015f\u0259b\u0259k\u0259 \u00fcz\u0259rind\u0259 m\u00f6vcud edildikd\u0259, qeyri-qanuni daxil edilmi\u015f \u0259mranlara qar\u015f\u0131 <a href=/configui#passwordheading>giri\u015f parolunun</a> t\u0259tbiq edilm\u0259sini ist\u0259y\u0259 bil\u0259rsiniz.";
