    t[11658] = "Your modem or router may support <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP), which permits automatic port forwarding. Ensure UPnP support for I2P+ is enabled on the <a href=/confignet>config page</a>, then try to activate UPnP on your modem/router and possibly your computer also. Now try restarting the <a href=/>I2P+ router</a>. If successful, I2P+ should report \"Status: OK\" in the side panel once the I2P+ router completes initial connectivity tests.";
    t[11659] = "Modem v\u0259 ya routeriniz <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP) d\u0259st\u0259kl\u0259y\u0259 bil\u0259r v\u0259 bu avtomatik port y\u00f6nl\u0259ndirm\u0259y\u0259 imkan verir. I2P+ \u00fc\u00e7\u00fcn UPnP d\u0259st\u0259yinin <a href=/confignet>konfiq sayt\u0131nda</a> aktiv oldu\u011funu t\u0259min edin, sonra UPnP-ni modem/routerinizi v\u0259 bel\u0259c\u0259 komp\u00fcterinizi aktiv etm\u0259y\u0259 c\u0259hd edin. \u0130ndi <a href=/>I2P+ routeri</a>ni yenid\u0259n ba\u015flatma\u011fa c\u0259hd edin. U\u011furlu olarsa, I2P+ routeri \u0259sas \u0259laq\u0259lilik testl\u0259rini ba\u015fa vurduqdan sonra yan paneld\u0259 \"Status: OK\" m\u0259lumat\u0131n\u0131 bildirilm\u0259lidir.";
