    t[11983] = "\u018fg\u0259r TCP portunuz daxil olan TCP-ni aktivl\u0259\u015fdir\u0259r\u0259k firewall il\u0259 t\u0259chiz edilibs\u0259, mar\u015frutla\u015fd\u0131r\u0131c\u0131lar sizinl\u0259 TCP vasit\u0259sil\u0259 \u0259laq\u0259 saxlaya bilm\u0259y\u0259c\u0259k v\u0259 bu, \u015f\u0259b\u0259k\u0259y\u0259 z\u0259r\u0259r ver\u0259c\u0259k.";
    t[11984] = "Local Identity";
    t[11985] = "Yerel Kimlik";
    t[11994] = "While I2P will work fine behind most firewalls, your speeds and network integration will generally improve if the I2P port is forwarded for both UDP and TCP.";
    t[11995] = "I2P \u0259n firewall arxas\u0131nda g\u00f6z\u0259l i\u015fl\u0259y\u0259c\u0259k baxmayaraq, I2P port h\u0259m UDP, h\u0259m d\u0259 TCP \u00fc\u00e7\u00fcn ir\u0259li \u0259g\u0259r s\u00fcr\u0259t v\u0259 \u015f\u0259b\u0259k\u0259 inteqrasiya \u00fcmumiyy\u0259tl\u0259 yax\u015f\u0131la\u015facaq.";
    t[12002] = "Shared Clients";
    t[12003] = "Payla\u015f\u0131lan M\u00fc\u015ft\u0259ril\u0259r";
    t[12006] = "Configuration files for the router, installed plugins, and router logs are stored in the following location:";
    t[12007] = "Router \u00fc\u00e7\u00fcn konfiqurasiya fayllar\u0131, qura\u015fd\u0131r\u0131lm\u0131\u015f plaginl\u0259r v\u0259 mar\u015frutla\u015fd\u0131r\u0131c\u0131 qeydl\u0259ri a\u015fa\u011f\u0131dak\u0131 yerd\u0259 saxlan\u0131l\u0131r:";
    t[12008] = "Postman's POP3 Mail Server (pop3.postman.i2p)";
