    t[12015] = "Plugin yenil\u0259m\u0259 y\u00fckl\u00fc plugin versiyas\u0131 {0} v\u0259 ya daha y\u00fcks\u0259k t\u0259l\u0259b edir";
    t[12018] = "Permanently banned";
    t[12019] = "Daimi qada\u011fa";
    t[12020] = "Tunnels longer than 3 hops (for example 2 hops + 0-2 hops, 3 hops + 0-1 hops, 3 hops + 0-2 hops), or a high quantity + backup quantity, may severely reduce performance or reliability.";
    t[12021] = "3 atlamadan uzun tunell\u0259r (m\u0259s\u0259l\u0259n, 2 atlama 0-2 atlama, 3 atlama 0-1 atlama, 3 atlama 0-2 atlama) v\u0259 ya y\u00fcks\u0259k miqdarda ehtiyat miqdar performans\u0131 v\u0259 ya etibarl\u0131l\u0131\u011f\u0131 ciddi \u015f\u0259kild\u0259 azalda bil\u0259r.";
    t[12022] = "Sidebar";
    t[12023] = "Yan panel";
    t[12024] = "A router that facilitates the connection to the network of another router that is behind a firewall.";
    t[12025] = "D\u00fcz\u0259ldilmi\u015f bir ruterd\u0259n sistem v\u0259 ya ofis faiyetini t\u0259min etm\u0259y\u0259 imkan ver\u0259n ruter.";
    t[12026] = "I2P FAQ";
    t[12027] = "I2P Tez-tez veril\u0259n suallar";
    t[12028] = "If you hover over the <i>Router Info</i> heading, your truncated router identity will be shown (the first four characters (24 bits) of your 44-character (256-bit) Base64 router hash). The full hash is shown on your <a href='netdb?r=.'>Network Database entry</a>. Never reveal this to anyone, as your router identity is uniquely linked to your IP address in the network database.";
    t[12029] = "E\u011fer <i>Router Info</i> ba\u015fl\u0131\u011f\u0131 \u00fczerine geldi\u011finizde, k\u0131rp\u0131lm\u0131\u015f y\u00f6nlendirici kimli\u011finiz g\u00f6sterilir (44 karakterli (256 bit) Base64 y\u00f6nlendirici tokas\u0131n\u0131n ilk d\u00f6rt karakteri (24 bit)). Tam tokas\u0131, <a href='netdb?r=.'>Network Veritaban\u0131 giri\u015finizde</a> g\u00f6sterilir. Bu bilgiyi kimseyle payla\u015fmay\u0131n, \u00e7\u00fcnk\u00fc y\u00f6nlendirici kimli\u011finiz a\u011f veritaban\u0131ndaki IP adresinizle benzersiz bir \u015fekilde ba\u011flant\u0131l\u0131d\u0131r.";
    t[12030] = "Previous";
    t[12031] = "\u018fvv\u0259lki";
    t[12032] = "Stopped router";
    t[12033] = "Router dayand\u0131r\u0131ld\u0131";
    t[12038] = "Directory listings (sometimes referred to as virtual directories) are enabled by default, so you can host files from a sub-directory of <code>docroot</code> without providing a page with links to the files. You can also serve content that exists outside of <code>docroot</code> by using a <a href=https://en.wikipedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'>symbolic link</a> to the desired directory.";
    t[12039] = "Qovluq siyah\u0131lar\u0131 (bazen sanal qovluqlar adlan\u0131r\u0131lmaqla) default olaraq aktivdir, bel\u0259likl\u0259, <code>docroot</code> alt qovlu\u011fundan fayllar\u0131 sayta linkl\u0259r verm\u0259d\u0259n xost ed\u0259 bil\u0259rsiniz. <code>docroot</code> xaricind\u0259 m\u00f6vcud olan m\u0259zmunu is\u0259, ist\u0259nil\u0259n qovlu\u011fa bir <a href=https://en.wikipedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'>simvolik link</a> istifad\u0259 ed\u0259r\u0259k r\u0259hb\u0259rl\u0259y\u0259 bil\u0259rsiniz.";
