    t[12062] = "Using the <i class=example>explicit</i> directive, a threshold can be applied to a remote destination listed in the definition itself, with the option to specify custom thresholds for multiple destinations. Remote destinations can also be excluded from the default threshold using the <i class=example>allow</i> keyword, or permanently blocked using the <i class=example>deny</i> keyword:";
    t[12063] = "\u018flaq\u0259 quru\u011funun \u00f6z\u00fcnd\u0259 d\u0259finitiona daxil olunmu\u015f uzaq m\u0259n\u015f\u0259y\u0259 x\u00fcsusi bir limit t\u0259yin ed\u0259n <i class=example>explicit</i> t\u0259limat\u0131n\u0131 istifad\u0259 ed\u0259r\u0259k, \u00e7ox sayda m\u0259n\u015f\u0259y\u0259 x\u00fcsusi limitl\u0259r t\u0259yin ed\u0259 bil\u0259rsiniz. Uzaq m\u0259n\u015f\u0259l\u0259r \u00fcz\u0259rind\u0259n \u00e7\u0131x\u0131lmamal\u0131 olan h\u0259d\u0259fl\u0259ri m\u00fcdafi\u0259 ed\u0259 bil\u0259c\u0259k <i class=example>izin</i> a\u00e7ar s\u00f6z\u00fc il\u0259 standart limitd\u0259n imtina ed\u0259 bil\u0259rsiniz, ya da h\u0259mi\u015f\u0259lik \u0259ng\u0259ll\u0259nmi\u015f bir v\u0259ziyy\u0259t yaradaraq <i class=example>deny</i> a\u00e7ar s\u00f6z\u00fcnd\u0259n istifad\u0259 ed\u0259 bil\u0259rsiniz:";
