    t[12183] = "S\u0259b\u0259b";
    t[12184] = "This setting determines the number of NetDb DHT buckets the Peer Exploration Job will reference when run. By default, the number of buckets to explore will vary depending on whether the router has been running for over an hour, if the router is hidden or in the 'K' bandwidth tier, and the number of known routers.";
    t[12185] = "Bu parametr NetDb DHT vedr\u0259l\u0259rinin say\u0131n\u0131 m\u00fc\u0259yy\u0259n edir H\u0259mkar k\u0259\u015ffiyyat\u0131 \u0130\u015fi icra ed\u0259rk\u0259n istinad ed\u0259c\u0259k. Standart olaraq, ara\u015fd\u0131rmaq \u00fc\u00e7\u00fcn vedr\u0259l\u0259rin say\u0131 mar\u015frutla\u015fd\u0131r\u0131c\u0131n\u0131n bir saatdan art\u0131q i\u015fl\u0259m\u0259sind\u0259n, routerin gizli v\u0259 ya 'K' bant geni\u015fliyi pill\u0259sind\u0259 olub-olmamas\u0131ndan v\u0259 m\u0259lum mar\u015frutla\u015fd\u0131r\u0131c\u0131lar\u0131n say\u0131ndan as\u0131l\u0131 olaraq d\u0259yi\u015f\u0259c\u0259k.";
