    t[12244] = "In the box marked <i>No Proxy for</i> add the line <code>127.0.0.1,localhost</code> to ensure the I2P console and other locally hosted websites are still available.";
    t[12245] = "<i>Proksi yoxdur</i> il\u0259 i\u015far\u0259l\u0259nmi\u015f qutuya I2P konsolunun v\u0259 yerli olaraq yerl\u0259\u015fdiril\u0259n dig\u0259r veb-saytlar\u0131n h\u0259l\u0259 d\u0259 \u0259l\u00e7atan olmas\u0131n\u0131 t\u0259min etm\u0259k \u00fc\u00e7\u00fcn <code>127.0.0.1,localhost</code> x\u0259ttini \u0259lav\u0259 edin.";
